(1, 'Refund Policy', 'refund-policy', '<div class=\"p-box\">\r\n<h3>1. Acceptance of Terms</h3>\r\n<p>By accessing or using the Application, you agree to be bound by these Terms and Conditions. If you do not agree to all the terms and conditions, you may not use the Application.</p>\r\n</div>\r\n<div class=\"p-box\">\r\n<h3>2. Use of the Application</h3>\r\n<p>You agree to use the Application for lawful purposes only and in accordance with these Terms and Conditions. You are solely responsible for all activities conducted through your account.</p>\r\n</div>\r\n<div class=\"p-box\">\r\n<h3>3. Booking and Payments</h3>\r\n<p>The Application allows users to book party-related services. By making a booking through the Application, you agree to pay any applicable fees and charges associated with the booking. Payments may be processed through third-party payment processors, and you agree to comply with their terms and conditions.</p>\r\n</div>\r\n<div class=\"p-box\">\r\n<h3>4. User Account</h3>\r\n<p>To use certain features of the Application, you may be required to create an account. You are responsible for maintaining the confidentiality of your account information and password. You agree to notify us immediately of any unauthorized use of your account.</p>\r\n</div>\r\n<div class=\"p-box\">\r\n<h3>5. User Content</h3>\r\n<p>You may have the opportunity to submit content, such as reviews and ratings, through the Application. By submitting content, you grant us a non-exclusive, worldwide, royalty-free, perpetual, irrevocable, sublicensable, and transferable license to use, reproduce, distribute, prepare derivative works of, display, and perform the submitted content.</p>\r\n</div>\r\n<div class=\"p-box\">\r\n<h3>6. Privacy</h3>\r\n<p>Your use of the Application is also governed by our Privacy Policy, which is incorporated by reference into these Terms and Conditions. Please review the Privacy Policy for information on how we collect, use, and disclose personal information.</p>\r\n</div>\r\n<div class=\"p-box\">\r\n<h3>7. Intellectual Property</h3>\r\n<p>The Application, including all content, features, and functionality, is owned by us or our licensors and is protected by intellectual property laws. You may not reproduce, distribute, modify, create derivative works of, publicly display, publicly perform, republish, download, store, or transmit any of the material on the Application.</p>\r\n</div>\r\n<div class=\"p-box\">\r\n<h3>8. Limitation of Liability</h3>\r\n<p>To the fullest extent permitted by applicable law, we shall not be liable for any indirect, incidental, special, consequential, or punitive damages, or any loss of profits or revenues, whether incurred directly or indirectly.</p>\r\n</div>', '', 1, '2023-04-07 11:06:02', '2024-03-12 10:23:29'),
(2, 'Privacy Policy', 'privacy-policy', '<div class=\"p-box\">\n							<h3>1. Information We Collect</h3>\n							<h4>1.1 Personal Information</h4>\n							<p>To provide you with our services, we may collect the following personal information:</p>\n							<ul>\n								<li>Name</li>\n								<li>Contact Information (email address, phone number)</li>\n								<li>Payment Information (if applicable)</li>\n								<li>Location Data</li>\n							</ul>\n							<h4>1.2 Usage Information</h4>\n							<p>We may also collect non-personal information about how you use the Application, including:</p>\n							<ul>\n								<li>Device Information (such as device type, operating system, and unique device identifiers)</li>\n								<li>Log Information (including details of your interactions with the Application, IP address, and timestamps)</li>\n							</ul>\n						</div>\n						<div class=\"p-box\">\n							<h3>2. How We Use Your Information</h3>\n							<h4>We use the information collected for the following purposes:</h4>\n							<ul>\n								<li>To provide and maintain the Application</li>\n								<li>To process bookings and payments</li>\n								<li>To communicate with you regarding your bookings and updates</li>\n								<li>To improve our services and develop new features</li>\n								<li>To personalize your experience and provide targeted content</li>\n								<li>To comply with legal obligations</li>\n							</ul>\n						</div>\n						<div class=\"p-box\">\n							<h3>3. Information Sharing</h3>\n							<h4>We do not sell, trade, or rent your personal information to third parties. We may share your information with:</h4>\n							<ul>\n								<li>Service Providers: Third-party service providers who assist us in operating the Application and providing services.</li>\n								<li>Legal Compliance: When required by law or in response to valid legal processes.</li>\n							</ul>\n						</div>\n						<div class=\"p-box\">\n							<h3>4. Security</h3>\n							<p>We employ reasonable measures to protect your personal information from unauthorized access, disclosure, alteration, and destruction.</p>\n						</div>\n						<div class=\"p-box\">	\n							<h3>5. Your Choices</h3>\n							<h4>You have the following choices regarding your information:</h4>\n							<ul>\n								<li>Opt-out of receiving promotional communications</li>\n								<li>Review and update your personal information</li>\n							</ul>\n						</div>\n						<div class=\"p-box\">\n							<h3>6. Changes to This Privacy Policy</h3>\n							<p>We may update this Privacy Policy from time to time. We will notify you of any changes by posting the new Privacy Policy on this page.</p>\n						</div>\n						<div class=\"p-box\">\n							<h3>7. Contact Us</h3>\n							<h4>If you have any questions or concerns about this Privacy Policy, please contact us at [contact@email.com].</h4>\n							<p>By using the Application, you acknowledge that you have read and understood this Privacy Policy.</p>\n						</div>', '', 1, '2023-04-07 11:06:02', '2023-04-07 09:17:55'),
