(1, 'Order Confirmation', 'order-confirmation', '<p>Hi,</p><p>Thank you for your order</p><p>Sample text here for order confirmation.</p>', 'Sent automatically to the customer after they place their order.', '2023-04-07 08:08:38', '2024-03-15 09:54:38'),
(2, 'Forgot Password', 'forgot-password', '<p>Hello #NAME#,<br><br>As per your request. We have generated a link to reset your password.&nbsp;<br><br>Please click on the link below to reset your password.<br><br>#RESET_LINK#<br><br>Thanks,<br>PartyBookr</p>', 'Sent automatically when the user request a reset password request.', '2023-04-07 08:08:38', '2024-03-15 09:54:45'),
(3, 'Registration Successful', 'registration-success', '<p>Hello #NAME#,</p><p>We are delighted to welcome you to PartyBookr!</p><p>Your registration with PartyBookr has been successfully completed. You can now enjoy all the features and benefits of our platform.</p><p>Your Name : #NAME#&nbsp;<br>Email : #EMAIL#</p><p>If you have any questions or need assistance, please feel free to contact our support team at [Support Email] or [Support Phone Number].</p><p>Thank you for choosing PartyBookr. We look forward to providing you with a seamless booking experience.</p><p>Best regards,&nbsp;<br>PartyBookr Team</p>', 'Sent automatically when user registered.', '2023-04-07 08:08:38', '2024-03-18 09:56:17'),
(4, 'Booked Event', 'booked-event', '<p>Hello #NAME#,</p><p>This is to confirm that your event has been successfully booked with PartyBookr.</p><p>Event Details:</p><ul><li>Event Name: #EVENT_NAME#</li><li>Date: #EVENT_DATE# to #EVENT_TO_DATE#</li><li>Location: #EVENT_LOCATION#</li></ul><p>If you have any questions or need further assistance, feel free to contact us.</p><p>Thank you for choosing PartyBookr for your event needs!</p><p>Best regards,&nbsp;<br>PartyBookr Team</p>', 'Sent automatically when user registered.', '2023-04-07 08:08:38', '2024-03-18 09:59:10'),
(5, 'Booking Confirmation', 'booking-confromation', '<p>Hello #NAME#,</p><p>We are pleased to inform you that your booking has been confirmed with PartyBookr. Below are the details of your reservation:</p><p>Booking Details:</p><ul><li>Booking ID: #BOOKING_ID#</li><li>Event Name: #EVENT_NAME#</li><li>Event Location: #EVENT_LOCATION#</li><li>Date: #EVENT_DATE# to #EVENT_TO_DATE#</li></ul><p>Please keep this email for your records. If you have any questions or need to make any changes to your booking, feel free to contact us.</p><p>Thank you for choosing PartyBookr. We look forward to hosting your event!</p><p>Best regards,&nbsp;<br>PartyBookr Team</p>', 'Sent automatically when user registered.', '2023-04-07 08:08:38', '2024-03-27 04:42:30'),
(6, 'Booking Rejected', 'booking-rejected', '<p>Hello #NAME#,</p><p>We regret to inform you that your booking request with PartyBookr has been rejected. We apologize for any inconvenience this may have caused.</p><p>If you have any questions or would like further clarification, please don\'t hesitate to reach out to us. We appreciate your understanding.</p><p>Thank you for considering PartyBookr for your event needs.</p><p>Best regards,&nbsp;<br>PartyBookr Team</p>', 'Sent automatically when user registered.', '2023-04-07 08:08:38', '2024-03-27 04:41:58'),
(8, 'Booking Cancel', 'booking-Cancel', '<p>Hello #NAME#,</p><p>This is to confirm that your event booking with PartyBookr has been successfully canceled.</p><p>Event Details:</p><ul><li>Event Name: #EVENT_NAME#</li><li>Date: #EVENT_DATE# to #EVENT_TO_DATE#</li><li>Time: #EVENT_TIME# to #EVENT_TO TIME#</li><li>Location: #EVENT_LOCATION#</li></ul><p>If you have any questions or need further assistance, feel free to contact us.</p><p>Thank you for considering PartyBookr for your event needs!</p><p>Best regards,&nbsp;</p><p>PartyBookr Team</p>', 'Sent automatically when user registered.', '2023-04-07 08:08:38', '2024-03-18 09:22:35'),
(9, 'Received New Booking', 'received-new-booking', '<p>Hello,</p><p>You have received a new booking. Here are the details:</p><p>Event Details:</p><ul><li>Booking Number: #BOOKING_NUMBER#</li><li>Event Name: #EVENT_NAME#</li><li>Date: #EVENT_DATE# to #EVENT_TO_DATE#</li><li>Time: #EVENT_TIME# to #EVENT_TO TIME#</li><li>Location: #EVENT_LOCATION#</li></ul><p>Thank you for using PartyBookr!</p><p>Best regards,&nbsp;</p><p>PartyBookr Team</p>', 'Sent automatically for vendor when booked event from user.', '2023-04-07 08:08:38', '2024-07-18 12:30:56');
