(5, 207, 15, '1,2,3,4', NULL, 'Indulge in unparalleled luxury at our hotel and restaurant. Immerse yourself in exquisite comfort with our plush accommodations and personalized service. Savor a culinary journey with delectable dishes crafted from the finest ingredients. Whether you\'re here for business or leisure, elevate your experience with us.', '2024-07-03 07:22:56', '2024-07-03 07:24:06'),
(6, 208, 15, '1,2,3', NULL, 'Showcase Catering is the exclusive provider of all food services at Barrett Roadhouse Function Centre. It has tirelessly crafted and served the finest, most delicious food at each and every function.', '2024-07-03 07:27:36', '2024-07-03 07:29:11'),
(7, 209, 15, '4,6,11', NULL, 'Whether youâre saying âI doâ followed by a sumptuous feast, toasting a special birthday in our private courtyard or joining us for one of our stylish Sunday Sessions, our versatile venue is the ideal backdrop for a memorable event. Featuring a spectacular bar, dining area, courtyard and private lounge room, we can accommodate up to 120 people for a cocktail function or 68 people for a delicious sit down feast.', '2024-07-03 07:55:44', '2024-07-03 07:56:55'),
(8, 210, 15, '5,7,12', NULL, 'Meet, greet and achieve your goals in the flexible conference and event spaces at our hotel in Perth.\r\n\r\nWe provide the perfect venue for meetings, with stylish and high-tech rooms and facilities. Each of our seven event spaces offers high-speed Wi-Fi access and other business amenities.\r\n\r\nPrime Lofts Perth offers an alternative to the conventional function space with free flowing, open and bright spaces as the focal point of this design styled hotel.', '2024-07-04 23:03:34', '2024-07-04 23:05:28'),
(9, 211, 15, '8,9,10', NULL, 'We are a not-for-profit community organisation doing a lot of different things! The site is run by a small team of staff and a great group of dedicated volunteers. Our volunteer-run farm grows fresh produce for our Saturday Farmerâs Market, we run educational tours and workshops for groups of all ages, host eco-friendly twilight markets and other events focussed on sustainability & kinder ways of living, and have an awesome inner-city greening team who take care of the QV1 rooftop gardens and 140 William St!', '2024-07-04 23:12:52', '2024-07-04 23:13:42'),
(10, 212, 15, '1,2,3', NULL, 'This amazing riverside venue is perfect for entertaining clients, hosting a celebration with family and friends, or even private dinners and cocktail receptions.', '2024-07-04 23:19:16', '2024-07-04 23:21:22'),
(11, 213, 16, '2,3,10', NULL, 'With Westerners Djs, at least 20 hours is dedicated to producing personalised entertainment. A moment in time that is unique to you, full of fun and connection.', '2024-07-04 23:28:03', '2024-07-04 23:29:07'),
(12, 214, 16, '3,5,11', NULL, 'Enhance Event Group curates and assembles the perfect wedding & event entertainment solution for their clients. We do this by drawing from a diverse pool of world-class talent so you can find the perfect package for your wedding or event.', '2024-07-04 23:46:33', '2024-07-04 23:47:43'),
(13, 215, 16, '1,9,10', NULL, 'This dynamic, sophisticated and original performer creates rave reviews all the time, whether it is on a theatre stage for thousands or in an intimate private setting, his performances will make your event memorable.', '2024-07-05 00:18:42', '2024-07-05 00:20:43'),
(14, 216, 16, '7,8,12', NULL, 'Unique style and most appropriate for corporate, weddings, clubs, restaurants, special birthdays and events. Sets to suit any mixed crowd of different cultures or ages.', '2024-07-05 00:31:46', '2024-07-05 00:33:08'),
(15, 217, NULL, NULL, NULL, 'Dylan of Majestic DJs fell into DJÃ­ng by accident. He believes, \"providing DJ services for a Bride and Groom is more than just about playing good music, itâs about providing a full solution to their reception needs when it comes to the musical atmosphere\".', '2024-07-05 00:41:33', '2024-07-05 00:41:33'),
(16, 218, 17, '1,2,3', NULL, 'With attention to detail we thoughtfully design and produce floral pieces that are delicate, natural, whimsical and spectacular. We aim to provide the most beautiful and freshest flowers Perth has to offer and specialise in doing unique, natural arrangements for any occasion while taking pride in what we do and always putting our love and soul into the pieces we create. Exceptional service is important to us and we always make sure our arrangements look gorgeous before we hand them over to you.', '2024-07-05 00:50:05', '2024-07-05 00:51:38'),
(17, 219, 17, '4,6,11', NULL, 'Every morning we are up early foraging and hunting for the best, freshest in season fresh flowers & lushest foliage we can source around Perth, Western Australia.', '2024-07-05 00:59:21', '2024-07-05 01:01:04'),
(18, 220, 17, '5,7,12', NULL, 'We are early risers here at The Flower Run. Every morning we wake up at the crack of dawn and head to the local flower markets. We like to arrive nice and early so we have the pick of the bunch (pun intended!)', '2024-07-05 01:17:01', '2024-07-05 01:18:07'),
(19, 221, 17, '8,9,10', NULL, 'Indoor Botanics delivers Perthâs best flower arrangements, hampers, bouquets, indoor plants and gifts.', '2024-07-05 01:24:29', '2024-07-05 02:24:24'),
(20, 222, 17, '2,5,9', NULL, 'Stunning and unique flower arrangements for any occasion of celebration, commiseration, or simple offering of love', '2024-07-05 02:29:55', '2024-07-05 02:30:54'),
(21, 223, 18, '4,7,8', NULL, 'Multi-award-winning humanitarian lawyer Rabiya Saddique was born and raised in Perth, and was faced with the discrimination, abuse, and racism as an Indian Muslim growing up in Australia in the 1970s. It was this upbringing that inspired her to change the lives of others through justice, equality, and inclusion.', '2024-07-05 02:38:05', '2024-07-05 02:39:18'),
(22, 224, 18, '4,6,7', NULL, 'Through self-motivation and a desire for a better life, Dr. Macey rose to become an A/Professor at the University of Western Australia. She is a renowned and well-respected Motivational Speaker and Author of a book.', '2024-07-05 02:45:55', '2024-07-05 02:46:24'),
(23, 225, 18, '7,8,9', NULL, 'David is an excellent and engaging talker. He provides very insightful knowledge and has an inspiring story to tell.', '2024-07-05 02:52:05', '2024-07-05 02:52:36'),
(24, 226, 18, '4,6,7', NULL, 'Allana is a media commentator and trainer, business strategist, and speaker & MC with a professional background spanning 20 years across big and small business. Lanna has been a regular media contributor to local and national media including 9 News, 882 6PR, The Age, The Sydney Morning Herald and has her own weekly column in The West Australian. Allanna also speaks regularly at conferences, business seminars across Australia and overseas on personal and business branding, PR, traditional & social media and much more.', '2024-07-05 03:00:21', '2024-07-05 03:00:45'),
(25, 227, 18, '10,11,12', NULL, 'Ailah is a hospitality and tourism sector specialist, her skill and understanding of âsocialâ translates to any application, and she leads the charge for digital empowerment across Australia.', '2024-07-05 03:05:18', '2024-07-05 03:07:19'),
(26, 228, 19, '1,2,3', NULL, 'We cater for the sweet tooth, savoury breakfasts and lunch, coffee and made to order platters. Our large in-store range is stocked daily however if you would like specific items or a larger order, please place your order at least 24 hours prior through our online ordering.', '2024-07-05 03:11:20', '2024-07-05 03:12:14'),
(27, 229, 19, '1,2,3,12', NULL, 'At These Cakes, we believe in sweetening up this journey we are all on together, and what better way to do that than with mouth-watering desserts! They have the ability to bring people together, transport us back in time, create lasting memories, and connect loved ones with each bite.', '2024-07-05 03:31:10', '2024-07-05 03:33:47'),
(28, 230, 19, '1,2,3,5,9', NULL, 'Alessandra\'s Cakes are glamorous, fabulous, delizioso! The shop creates luxurious cakes and desserts drawing on the Italian and French traditions of her Northern Italian upbringing. Designs are chic, colourful, and always perfected to the finest detail. For Perth custom cakes, Alessandra\'s Cakes is the only name you need to know.', '2024-07-05 03:42:15', '2024-07-05 03:43:02'),
(29, 231, NULL, NULL, NULL, 'We bake a variety of pastries in small batches throughout the morning and sometimes stock the counter with fresh sandwiches on house made bread. We encourage you to bring your own coffee cups and containers to takeaway, while providing dine in cup and plate options for those who opt to sit on our stools on sunnier days.', '2024-07-05 03:55:24', '2024-07-05 03:55:24'),
(30, 232, 19, '2,3,7,9,10', NULL, 'Each of our sourdough loaf Is handcrafted\r\nusing freshly-milled Western Australian Wheat,\r\nTo give you an authentic bread experience', '2024-07-05 04:02:23', '2024-07-05 04:03:07'),
(31, 233, 21, '1,2,3', NULL, 'Amon\'s Sartorial Splendor redefines luxury dÃ©cor with exquisite craftsmanship and timeless elegance. From lavish weddings to prestigious events, our bespoke creations elevate every occasion to a masterpiece of sophistication. Experience the epitome of style and refinement with Amon\'s Sartorial Splendor.', '2024-07-05 06:51:57', '2024-07-05 06:53:53'),
(32, 234, 21, '3,4,6,11', NULL, 'At Burton Design Studio, we specialize in turning dreams into reality. Our team of skilled artisans and designers work tirelessly to create spaces that inspire and delight. From custom furniture pieces to curated art collections, every detail is crafted with care and precision. Let us bring your vision to life and transform your space into something truly extraordinary. Welcome to Burton Design Studioâwhere design meets excellence.', '2024-07-05 07:06:34', '2024-07-05 07:08:34'),
(33, 235, 21, '3,4,7,10,11', NULL, 'Step into Cala Mares Urban Chic DÃ©cor, where city streets inspire stylish living. Our curated collections blend contemporary trends with urban flair, featuring edgy furniture, bold artwork, and industrial accents. Whether you\'re a city dweller or craving urban vibes, we\'ll transform your space into an inviting sanctuary that reflects your unique style. Welcome to urban chic, reimagined with Cala Mares.', '2024-07-05 07:20:18', '2024-07-05 07:34:04'),
(34, 236, 21, '3,4,10,11,12', NULL, 'Welcome to Karla\'s Party PiÃ±ata DÃ©cor! We bring fun and festivity to every event with our vibrant decorations. Perfect for birthdays, weddings, or any celebration, our dÃ©cor ensures your party is unforgettable.', '2024-07-06 00:19:43', '2024-07-06 00:30:40'),
(35, 237, 21, '3,4,7,8', NULL, 'Welcome to Kris Machester\'s Rugged DÃ©cor, where strength and style converge to create spaces with a distinctly masculine touch. Our expertly curated dÃ©cor pieces bring a bold, rugged aesthetic to any environment, making it perfect for those who appreciate robust design elements and timeless appeal.', '2024-07-06 00:39:46', '2024-07-06 00:41:17'),
(36, 238, 22, '1,2,9,10', NULL, '\"Top Shelf Party Bus\" offers a premier luxury transportation service tailored for special events and celebrations. Renowned for its exceptional customer service and high-end amenities, the company ensures a stylish and comfortable experience for its clients. \"Top Shelf Party Bus\" is highly regarded for its commitment to providing an unforgettable party experience on wheels', '2024-07-06 01:20:04', '2024-07-06 01:21:53'),
(37, 239, 22, '1,2,3,6', NULL, 'At Justin\'s Revelry Rovers, we specialize in providing unforgettable party bus experiences for any occasion. Whether you\'re celebrating a birthday, bachelor or bachelorette party, corporate event, or just a night out on the town with friends, our fleet of luxurious party buses is here to elevate your celebration to the next level.', '2024-07-06 01:29:01', '2024-07-06 01:30:54'),
(38, 240, 22, '2,4,6,11', NULL, '\"Liberty Party Express: Harley Edition\" offers the ultimate fusion of freedom and fun on wheels. Picture sleek party buses adorned with iconic Harley-Davidson motifs, inside, plush seating, top-notch sound systems, and vibrant lighting create the perfect ambiance for any celebration. Our professional team ensures every detail is covered, making your journey an unforgettable experience, whether it\'s a bachelor bash or corporate event. Get ready to ride in style and make memories that last a lifetime with Liberty Party Express: Harley Edition.', '2024-07-07 22:06:29', '2024-07-07 22:09:39'),
(39, 241, 22, '5,7,9,12', NULL, 'Step into a world of fun and excitement with our party van experience! Picture yourself surrounded by friends, enjoying comfy seating, lively lights, and a rocking sound system. Whether it\'s a birthday bash or a night out with friends, we bring the party to you, turning any occasion into an unforgettable celebration. Get ready to make memories that last a lifetime with our mobile party experience!', '2024-07-07 22:18:06', '2024-07-07 22:22:01'),
(40, 242, 22, '3,8,9,10', NULL, 'Hop aboard Betty\'s Whimsical Party Wagon, where the fun hits new heights without sacrificing safety! Picture a double-decker extravaganza filled with vibrant colors, funky decor, and an atmosphere buzzing with excitement. With comfy seating below and panoramic views above, every moment promises thrills and laughter. Our expert staff ensures your adventure is not just fun, but also completely secure. So, whether it\'s a birthday bash or a night out with friends, let\'s turn the ordinary into the extraordinaryâsafely aboard Betty\'s Whimsical Party Wagon!', '2024-07-07 22:29:35', '2024-07-07 22:31:44'),
(41, 243, 23, '5,8,9,10', NULL, 'At Calvin\'s Elegance Rentals, our comprehensive packages include delivery, setup, and pickup services, ensuring a hassle-free experience for your event. Additionally, our expert team provides personalized consultation to help you select the perfect equipment and furniture to elevate your occasion. With Calvin\'s, you can expect not just rentals, but a seamless and elegant solution tailored to your needs.', '2024-07-07 22:40:09', '2024-07-07 22:41:58'),
(42, 244, 23, '2,3,5,7,8,9', NULL, 'Joe Muggin\'s believes that every event deserves the perfect touch of elegance and functionality. Whether you\'re planning a lavish wedding, a corporate gala, or a cozy private gathering, our extensive collection of high-quality equipment and furnishings is designed to elevate your occasion to new heights.', '2024-07-07 23:01:26', '2024-07-07 23:03:11'),
(43, 245, 23, '3,7,8,9', NULL, 'EastHire Equipment & Furniture is a leading provider of high-quality equipment and furniture rental services, catering to both residential and commercial clients. With a commitment to excellence and customer satisfaction, we offer a diverse range of products to meet the needs of various events, projects, and occasions.', '2024-07-07 23:26:31', '2024-07-07 23:28:15'),
(44, 246, 23, '4,5,6,7,9', NULL, 'Prime Rick Rentals is your premier destination for sports-themed event rentals, providing top-quality equipment and furniture tailored to sporting events, tournaments, and athletic gatherings. With a commitment to excellence and a passion for sports, Prime Rick Rentals is dedicated to helping you create memorable and successful events.', '2024-07-07 23:53:50', '2024-07-07 23:55:26'),
(45, 247, 23, '5,6,7,8,9', NULL, 'At YellowPedal Event Rentals, we understand the unique needs of organizing a successful bike tournament. With our specialized equipment and dedicated services, we aim to provide comprehensive solutions tailored to the requirements of each event.', '2024-07-08 00:15:17', '2024-07-08 00:17:21'),
(46, 248, 24, '4,5,6,7', NULL, 'Welcome to Kolton Malone\'s Manly Feasts & Libations, where we specialize in crafting hearty menus and exceptional drinks for all occasions. Our focus is on delivering robust flavors and top-notch service, whether you\'re celebrating a milestone or hosting a corporate event.', '2024-07-08 00:41:54', '2024-07-08 00:43:21'),
(47, 249, 24, '1,2,3', NULL, 'Step into the world of Norta Gem Elegant Affairs & Libations, where we specialize in creating exquisite culinary experiences paired with exceptional libations, all tailored to add a touch of elegance to your event. Whether you\'re hosting a lavish wedding, a sophisticated soirÃ©e, or a corporate gala, our team of expert caterers is dedicated to making your occasion truly memorable.', '2024-07-08 00:50:33', '2024-07-08 00:52:15'),
(48, 250, 24, '4,6,11', NULL, 'Step into the realm of Ellen\'s Bold Bite & Booze, where culinary adventure meets spirited revelry. Our team specializes in crafting adventurous menus paired with handcrafted cocktails, promising a feast that ignites your taste buds and invigorates your senses.', '2024-07-08 01:21:01', '2024-07-08 01:23:30'),
(49, 251, 24, '5,7,12', NULL, 'Step into the realm of Mosh\'s Hellenic Feast: The Wrath of Zeus, where the flavors of ancient Greece come alive in a modern culinary adventure. Prepare to embark on a culinary journey fit for the gods themselves as we tantalize your taste buds with bold and authentic Greek cuisine.', '2024-07-08 01:33:52', '2024-07-08 01:36:13'),
(50, 252, 24, '8,9,10', NULL, 'Welcome to Galaleo\'s Chill Catering Co., where we specialize in creating laid-back culinary experiences that are perfect for any occasion. Our focus is on delivering delicious food in a relaxed setting, allowing you and your guests to unwind and enjoy each moment.', '2024-07-08 03:06:42', '2024-07-08 03:08:17'),
(51, 253, 25, '1,2,3', NULL, 'Welcome to Marshel Olaine Extravaganza Events, where dreams come to life! We specialize in crafting unforgettable experiences for all your special occasions. Whether it\'s a lavish wedding, a milestone birthday celebration, or a corporate gala, our dedicated team is here to turn your vision into reality. From exquisite decor and impeccable planning to seamless execution, we handle every aspect of your event with precision and flair. Let us take the stress out of party planning so you can focus on enjoying every moment. Get ready to create memories that will last a lifetime with Marshel Olaine Extravaganza Events', '2024-07-08 03:22:20', '2024-07-08 03:28:04'),
(52, 254, 25, '1,4,6,11', NULL, 'Planning a party? Look no further! I\'m Carol, and I specialize in creating laid-back, stress-free events that everyone will love. With my Cool Calm Party Productions, you can relax and enjoy the party while I take care of all the details.', '2024-07-08 03:42:03', '2024-07-08 03:44:24'),
(53, 255, 25, '1,2,5,7,12', NULL, 'Welcome esteemed guests, it is with the utmost pleasure that I extend to you an invitation to embark on an extraordinary journey of elegance and sophistication with Rey\'s Classy Celebration Coordination. As your premier event curator, I am dedicated to orchestrating an experience of unparalleled refinement, where every detail exudes style and luxury.', '2024-07-08 04:08:09', '2024-07-08 04:28:09'),
(54, 256, 25, '1,2,8,9,10', NULL, 'Are you ready to elevate your next event to unparalleled heights of sophistication and style? Look no further than Gal Vatron\'s Gala Productions. With a passion for perfection and an unwavering commitment to excellence, I am here to transform your vision into a reality that surpasses even your wildest dreams.', '2024-07-08 04:36:09', '2024-07-08 04:38:19'),
(55, 257, 25, '1,2,3', NULL, 'Step into the world of luxury and sophistication with Sumitpo\'s High Society Affairs, where every event is a masterpiece of elegance and refinement. As your premier event planner, I specialize in curating opulent affairs that exude glamour and style, leaving a lasting impression on you and your esteemed guests.', '2024-07-08 04:53:11', '2024-07-08 04:55:06'),
