(65, 317, 26, NULL, NULL, 'Esthetics Furniture offers a sophisticated selection of contemporary and classic furniture for residential and commercial spaces in Sydney. Specializing in stylish and functional pieces, their range includes everything from elegant living room furniture to practical office solutions. With a commitment to quality and design, Esthetics Furniture transforms any space into a refined and comfortable environment.', '2024-08-19 08:58:45', '2024-08-19 09:22:00'),
(66, 318, 26, NULL, NULL, 'Oak Furniture in Brisbane provides high-quality, durable wooden furniture with a focus on timeless oak designs. Catering to both modern and traditional tastes, they offer a range of products including dining tables, chairs, and storage solutions. Known for their craftsmanship and attention to detail, Oak Furniture delivers pieces that blend beauty with functionality.', '2024-08-19 09:37:17', '2024-08-19 09:47:10'),
(67, 319, 26, NULL, NULL, 'KATMEAD Furniture in the Philippines offers a diverse collection of stylish and practical furniture for various needs. From elegant living room sets to versatile office furniture, they provide quality pieces that enhance any space. Known for their exceptional craftsmanship and customer-focused service, KATMEAD Furniture brings both comfort and sophistication to homes and businesses.', '2024-08-19 09:48:12', '2024-08-19 10:01:56'),
(68, 320, 24, NULL, NULL, 'Cater Tails Sydney offers exceptional catering for all types of events in Sydney. From intimate gatherings to grand celebrations, they provide gourmet options and full-service catering with a focus on quality and professionalism. Their packages suit weddings, corporate events, and private parties.', '2024-08-19 13:24:39', '2024-08-19 13:31:44'),
(69, 321, 24, NULL, NULL, 'Cater Bros Brisbane delivers high-quality catering solutions across Brisbane. Catering to both small and large events, their packages range from simple to extravagant, ensuring a culinary success. Their flexible service and attention to detail make them a top choice for any occasion.', '2024-08-19 13:33:26', '2024-08-19 13:41:08'),
(70, 322, 24, NULL, NULL, 'Cater Care Zamboanga offers diverse catering packages for events of all sizes. With options ranging from traditional to contemporary, they provide authentic dining experiences with professional service and detailed event setup.', '2024-08-19 13:42:13', '2024-08-19 13:57:54'),
(71, 323, 17, NULL, NULL, 'Antique Garden Sydney specializes in elegant floral arrangements for any event. They offer a variety of packages with stunning centerpieces and decorations, combining creativity with professionalism to enhance any occasion.', '2024-08-19 14:00:07', '2024-08-19 14:01:04'),
(72, 324, 17, NULL, NULL, 'The Flower Shop Brisbane provides beautiful and elegant floral services for all events. Their comprehensive packages include centerpieces, venue decorations, and custom arrangements, ensuring memorable and stylish events.', '2024-08-19 14:10:02', '2024-08-19 14:11:43'),
(73, 325, 17, NULL, NULL, 'Urban Flowers Philippines offers customized floral solutions for any event. Their elegant and impactful arrangements are designed to enhance both small and large gatherings, ensuring each event is visually stunning and memorable.', '2024-08-19 14:15:54', '2024-08-19 14:24:41'),
(74, 326, 15, '1,2,3,5,6,7,8,9,10,11,12', NULL, 'Welcome to FunZone Kids Party Place, where imagination meets celebration! Our vibrant, themed party venue offers interactive games, creative activities, and a safe environment for children to explore and enjoy. From birthday bashes to special events, we provide all-inclusive packages, making every party a memorable adventure for kids and stress-free for parents!', '2024-08-19 21:45:48', '2024-08-19 21:53:47'),
