(15, 208, 'Little Explorers Package', '', '', '- Venue decoration with colorful balloons and banners.\r\n- Themed entertainment such as magic shows, puppet shows, or clown performances.\r\n- Face painting and balloon twisting activities.\r\n- Kid-friendly buffet with a variety of snacks and drinks.\r\n- Goodie bags for all the little guests.\r\n- Option for a themed cake or cupcakes.', 399, NULL, 1, '2024-07-03 13:01:50', '2024-07-03 13:01:50'),
(16, 208, 'Glow Party Package', '', '', '- Neon-themed venue decor with UV lights and glow sticks.\r\n- DJ booth with a professional DJ playing the latest hits.\r\n- Dance floor with fog machines and laser lights.\r\n- Mocktail bar serving vibrant non-alcoholic drinks.\r\n- Photo booth with funky props.\r\n- Customized Snapchat filter for the event.', 499, NULL, 1, '2024-07-03 13:02:48', '2024-07-03 13:02:48'),
(17, 208, 'Casino Night Bash', '', '', '- Themed venue decorated to resemble a high-end casino.\r\n- Professional dealers at blackjack, poker, and roulette tables.\r\n- Customized \"fun money\" for guests to play with.\r\n- Cocktail bar with skilled bartenders crafting classic drinks.\r\n- Buffet with upscale finger foods and desserts.\r\n- Prizes for top players at the end of the night.', 999, NULL, 1, '2024-07-03 13:04:38', '2024-07-03 13:04:38'),
(18, 209, 'Sumptuous Feast & Celebration', '', '', '- Enjoy a tailored, multi-course feast in our elegant dining area, complete with ambient lighting.\r\n- Raise a toast with champagne as you celebrate your milestones.\r\n- Let live music or a DJ set the mood while you dance the night away.\r\n- Capture precious moments with professional photography services.\r\n- Send guests home with personalized party favors to remember the night.', 599, NULL, 1, '2024-07-03 13:49:28', '2024-07-03 13:49:28'),
(19, 209, 'Networking Excellence Experience', '', '', '- Immerse yourself in our sophisticated venue, designed for professional ambiance and networking interactions.\r\n- Engage with industry experts through keynote speeches or panel discussions on relevant topics.\r\n- Foster connections and collaboration through networking games and icebreakers tailored to your event.\r\n- Indulge in our premium open bar, offering top-shelf liquor and signature cocktails to elevate your experience.\r\n- Delight your palate with gourmet hors d\'oeuvres and carving stations, meticulously crafted to impress.\r\n- Enhance your brand presence with branded promotional materials and gift bags for attendees, leaving a lasting impression.', 799, NULL, 1, '2024-07-03 13:50:28', '2024-07-03 13:50:28'),
(20, 209, 'Masquerade Magic Highlights', '', '', '- Enchanting Ambiance: Our elegant venue is adorned with masks, feathers, and drapes, transporting you to a world of mystery and intrigue.\r\n- Captivating Entertainment: Dance the night away to sultry tunes spun by a live band or DJ, adding to the allure of the evening.\r\n- VIP Experience: Retreat to our exclusive VIP lounge area, where bottle service and exclusive entertainment await to elevate your experience.\r\n- Exotic Libations: Indulge in specialty drinks from our exotic cocktail bar, expertly crafted to tantalize your senses and complement the ambiance.\r\n- Glamorous Photo Opportunities: Strike a pose at our themed photo booth, adorned with glamorous props to capture the magic of the night.\r\n- Sensational Performances: Be mesmerized by sensual burlesque or cabaret performances, adding an element of sophistication and excitement to the evening.', 699, NULL, 1, '2024-07-03 13:51:27', '2024-07-03 13:51:27'),
(21, 210, 'Professional Development Package', '', '', 'Modern conference venue with state-of-the-art audiovisual equipment.\r\n- Keynote speakers and breakout sessions covering industry trends and insights.\r\n- Networking lounges with designated meeting areas.\r\n- Buffet-style lunch featuring healthy options and dietary accommodations.\r\n- Interactive expo booths showcasing the latest products and services.\r\n- Customized event app for session schedules and attendee engagement.', 699, NULL, 1, '2024-07-05 04:35:59', '2024-07-05 04:39:02'),
(22, 210, 'Flexible Conference Package', '', '', '- Our venue boasts modern amenities and state-of-the-art audiovisual equipment, ensuring your conference needs are met.\r\n- Engage with keynote speakers and participate in insightful breakout sessions, keeping you updated on industry trends.\r\n- Network and collaborate in our dedicated lounges, designed for productive meetings and discussions.\r\n- Enjoy a buffet-style lunch with healthy options, accommodating various dietary needs to keep you energized throughout the day.\r\n- Explore interactive expo booths displaying the latest products and services, offering valuable insights and connections.\r\n- Stay organized and engaged with our custom event app, providing easy access to session schedules and facilitating attendee interaction.', 899, NULL, 1, '2024-07-05 04:36:40', '2024-07-05 04:39:21'),
(23, 210, 'Enchanted Romance Package', '', '', '- Step into an elegant venue adorned with soft lighting, lush floral arrangements, and flowing drapery, setting the stage for your fairy tale romance.\r\n- Serenade your guests with the harmonious melodies of a live string quartet or pianist during the ceremony and cocktail hour, creating a magical ambiance.\r\n- Raise a toast to love and happiness with a champagne toast and indulge in a delectable canapÃ© reception, delighting the senses.\r\n- Dine in style with a multi-course plated dinner, featuring customizable menu options tailored to your tastes and preferences.\r\n- Let our experienced wedding planner guide you through every step of the journey, ensuring a seamless and stress-free celebration.\r\n- Leave a lasting impression with customized wedding favors and a guestbook, capturing precious memories of your enchanted day.', 499, NULL, 1, '2024-07-05 04:37:09', '2024-07-05 04:40:12'),
(24, 211, 'Farm City Warehouse Music Festival Package', '', '', 'Step into our dynamic outdoor venue, featuring multiple stages hosting live bands and DJs, ensuring non-stop entertainment and a diverse lineup of musical talent.\r\n- Immerse yourself in the vibrant atmosphere of our festival grounds, adorned with captivating art installations and interactive displays that ignite your imagination and spark conversation.\r\n- Explore our food truck village, where a tantalizing array of culinary delights awaits, from savory street food to indulgent desserts, satisfying every craving and delighting every palate.\r\n- Quench your thirst at our craft beer garden, where you can sample a selection of locally brewed beers and specialty brews, each sip a celebration of craftsmanship and flavor.\r\n- Elevate your festival experience with our VIP ticket option, granting you exclusive access to lounges and artist meet-and-greets, allowing you to mingle with performers and enjoy VIP amenities in style.\r\n- Don\'t miss the opportunity to take home a piece of the festival magic with our festival merchandise booths, offering a curated selection of apparel and memorabilia to commemorate your experience.', 399, NULL, 1, '2024-07-05 04:45:15', '2024-07-05 04:45:15'),
(25, 211, 'Community Celebration Package', '', '', '- Our welcoming venue is adorned with religious symbolism and cultural decor, creating a warm and inclusive atmosphere for all.\r\n- Experience a meaningful religious ceremony officiated by a respected leader or clergy member, fostering spiritual unity and reflection.\r\n- Share in the joy of community with a potluck or catered dinner featuring traditional dishes, a feast for the senses that celebrates cultural heritage.\r\n- Be captivated by cultural performances or religious music, showcasing the rich tapestry of talent within our community and inspiring hearts and minds.\r\n- Find solace and connection in our dedicated prayer or meditation space, offering a tranquil retreat for personal reflection and spiritual renewal.\r\n- Give back to the community with a charity drive or volunteer activity, joining together to support a meaningful cause and make a positive impact in the world.', 499, NULL, 1, '2024-07-05 04:46:02', '2024-07-05 04:46:02'),
(26, 211, 'School Spirit Extravaganza Package', '', '', '- Transform your school gymnasium or outdoor field with vibrant banners, mascots, and school colors, creating an atmosphere of unity and enthusiasm.\r\n- Dance the day away with a DJ or live band playing popular music, setting the perfect backdrop for a high-energy celebration.\r\n- Enjoy carnival-style games and activities, including dunk tanks, ring toss, and more, ensuring endless fun for everyone.\r\n- Savor a variety of delicious cuisines from our food truck rally, featuring student-favorite foods to satisfy every craving.\r\n- Showcase student talent with a thrilling talent show or lip-sync battle, highlighting the unique skills and creativity of your school community.\r\n- Purchase customized event T-shirts and merchandise to commemorate the day and show off your school spirit with pride.', 999, NULL, 1, '2024-07-05 04:46:51', '2024-07-05 04:46:51'),
(27, 212, 'Kids Adventure Party Package', '', '', '- Venue decoration with colorful balloons and banners.\r\n- Themed entertainment such as magic shows, puppet shows, or clown performances.\r\n- Face painting and balloon twisting activities.\r\n- Kid-friendly buffet with a variety of snacks and drinks.\r\n- Goodie bags for all the little guests.\r\n- Option for a themed cake or cupcakes.', 699, NULL, 1, '2024-07-05 04:52:46', '2024-07-05 04:52:46'),
(28, 212, 'Neon Night Party Package', '', '', '- Neon-themed decor with UV lights and glow sticks.\r\n- DJ playing the latest hits.\r\n- Dance floor with fog machines and laser lights.\r\n- Mocktail bar with vibrant non-alcoholic drinks.\r\n- Photo booth with fun props.\r\n- Customized Snapchat filter for the event.', 699, NULL, 1, '2024-07-05 04:53:57', '2024-07-05 04:53:57'),
(29, 212, 'High Stakes Casino Experience', '', '', '- Step into a world of luxury and excitement with our High Stakes Casino Experience. Our venue is adorned with opulent decor reminiscent of a high-stakes casino, creating an ambiance of sophistication and allure.\r\n- Professional dealers oversee blackjack, poker, and roulette tables, ensuring guests experience the thrill of authentic casino gaming at its finest.\r\n- Customized \"fun money\" is provided to guests, allowing them to immerse themselves in the exhilarating atmosphere without any financial risk, making every moment memorable.\r\n- Our cocktail bar is staffed with skilled bartenders, serving up a selection of classic drinks with style and finesse, ensuring your taste buds are as satisfied as your gaming instincts.\r\n- Indulge in our buffet featuring a gourmet spread of upscale finger foods and delectable desserts, curated to satisfy even the most discerning tastes, adding a touch of culinary excellence to your evening.\r\n- Prizes are awarded to top players at the culmination of the night, adding an extra layer of competition and prestige to the event, making every win a cause for celebration.', 789, NULL, 1, '2024-07-05 04:54:42', '2024-07-05 04:54:42'),
(30, 213, 'High Stakes Casino Package', '', '', '-Transport your venue to the rugged charm of the Wild West with our authentic casino setup.\r\n-Blackjack, poker, and roulette tables managed by skilled professionals for an immersive gaming experience.\r\n-Guests receive play money, ensuring endless entertainment without the worry of losing real cash.\r\n-Indulge in a selection of handcrafted cocktails and gourmet bites served with a touch of Western hospitality.\r\n-Top players vie for exciting rewards, adding an extra layer of excitement to the night..', 689, NULL, 1, '2024-07-05 05:01:01', '2024-07-05 05:01:01'),
(31, 213, 'Frontier Gaming Saloon by Westerners DJs', '', '', '-Access to the Ultimate Gaming Saloon:Step into our Frontier Gaming Saloon, where you\'ll find consoles, VR setups, and classic arcade machines awaiting your challenge.\r\n-Showdown Tournaments: Engage in thrilling showdown tournaments, with champions claiming victory and earning prestigious prizes.\r\n- Chuckwagon Buffet: Refuel your gaming prowess with our Chuckwagon Buffet, featuring hearty favorites like sliders, nachos, and old-fashioned milkshakes.\r\n-DIY Cowboy Cupcake:Corral Saddle up at our DIY Cowboy Cupcake Corral, where you can decorate your own cupcakes with a variety of Western-inspired toppings.\r\n-Photo Shootout:Contest Capture the moments of your Wild West adventure and join the Photo Shootout Contest using a unique event hashtag, with grand rewards awaiting the most creative cowpokes.', 689, NULL, 1, '2024-07-05 05:05:37', '2024-07-05 05:05:37'),
(32, 213, 'Western Frontier Warehouse Music Festival Package', '', '', '-Dynamic Outdoor Venue: Step into our vibrant outdoor venue, featuring multiple stages hosting live bands and DJs for non-stop entertainment and a diverse lineup of musical talent.\r\n-Immersive Festival Atmosphere: Immerse yourself in the lively ambiance of our festival grounds, adorned with captivating art installations and interactive displays that ignite your imagination and foster engaging conversations.\r\n-Food Truck Village: Explore our bustling food truck village, offering a tantalizing array of culinary delights ranging from savory street food to indulgent desserts, catering to every craving and delighting every palate.\r\n-Craft Beer Garden: Quench your thirst at our artisanal craft beer garden, where you can sample a selection of locally brewed beers and specialty brews, each sip a celebration of craftsmanship and flavor.\r\n-VIP Experience: Elevate your festival experience with our VIP ticket option, granting you exclusive access to lounges and artist meet-and-greets, allowing you to mingle with performers and enjoy VIP amenities in style.\r\n-Festival Merchandise: Don\'t miss the opportunity to bring home a piece of the festival magic with our festival merchandise booths, offering a curated selection of apparel and memorabilia to commemorate your unforgettable experience.', 1000, NULL, 1, '2024-07-05 05:06:25', '2024-07-05 05:06:25'),
(33, 214, 'Sparkling Celebration Bash', '', '', '- Transform your venue into a sparkling oasis of celebration, adorned with elegant decor and ambient lighting to create a festive atmosphere..\r\n- Enjoy the company of your guests in a relaxed and inviting setting, where laughter and conversation flow freely, making it the perfect backdrop for a casual yet memorable gathering..\r\n- Engage in a variety of entertaining activities tailored for all ages and interests, from friendly competitions and interactive games to live entertainment and photo booths, ensuring there\'s something for everyone to enjoy.\r\n-Treat your taste buds to a delightful array of culinary delights, including savory appetizers, refreshing beverages, and delectable desserts, meticulously curated to please even the most discerning palates..\r\n- Raise a toast to the occasion with a selection of signature cocktails, mocktails, and artisanal beverages, expertly crafted by our skilled bartenders, adding a touch of sophistication to your festivities.\r\n- Conclude the evening with heartfelt gestures of appreciation, such as personalized party favors or commemorative gifts, to thank your guests for sharing in your joyous \"Sparkling Celebration Bash.\"', 1009, NULL, 1, '2024-07-05 05:25:49', '2024-07-05 05:25:49'),
(34, 214, 'Joyful Wedding Blissge', '', '', '- Enter a venue brimming with joy, adorned with twinkling lights, vibrant florals, and breezy drapery, setting the scene for your blissful wedding celebration.\r\n- Serenade your guests with the uplifting melodies of a live band or acoustic guitarist, filling the air with music that radiates happiness and love during both the ceremony and cocktail hour.\r\n- Raise your glasses in a toast to everlasting joy and laughter with a champagne toast, followed by a scrumptious assortment of hors d\'oeuvres that tickle the taste buds and spread smiles all around.\r\n- Indulge in a delightful multi-course plated dinner, featuring a selection of mouthwatering dishes crafted to your liking, ensuring a culinary experience that delights and satisfies.\r\n- Relax and bask in the happiness of your special day, knowing that our experienced wedding planner is on hand to handle every detail, ensuring a stress-free celebration that allows you to focus on what truly matters - each other.\r\n- Send your guests home with hearts full of happiness and memories to cherish, thanks to personalized wedding favors and a guestbook filled with well wishes and love, capturing the joy of your wedding day for years to come.', 409, NULL, 1, '2024-07-05 05:27:58', '2024-07-05 05:27:58'),
(35, 214, 'Extravagant Engagement Gala', '', '', '- Indulge in a decadent, multi-course feast crafted to perfection, served in our exquisite dining area adorned with enchanting ambient lighting, creating an atmosphere of luxury and elegance.\r\n- Toast to your love and future together with glasses of champagne, celebrating the joyous milestones of your engagement surrounded by cherished family and friends.\r\n- Let the rhythm of live music or a talented DJ sweep you onto the dance floor, where you can dance the night away in celebration of your love story unfolding.\r\n- Preserve the magic of the evening with professional photography services capturing every precious moment, ensuring that the memories of your engagement gala are forever immortalized.\r\n- Extend the warmth and gratitude of the evening to your guests by sending them home with personalized party favors, a thoughtful token of appreciation that will serve as a cherished reminder of the unforgettable celebration they shared with you.', 933, NULL, 1, '2024-07-05 05:43:53', '2024-07-05 05:43:53'),
(36, 215, 'Achour\'s Little Stars Theater Adventure Package', '', '', '- Theater-inspired venue decoration featuring vibrant curtains, stage props, and dazzling lights, transforming the space into a captivating theatrical setting.\r\n- Themed entertainment reminiscent of a grand stage production, with enchanting magic shows, whimsical puppet performances, or entertaining clown acts, ensuring an immersive experience for all.\r\n- Theatrical activities including face painting and balloon twisting, where children can transform into characters from their favorite stories and adventures.\r\n- A kid-friendly buffet offering a delightful array of snacks and drinks, fit for the young stars of the show.\r\n- Goodie bags for all the little guests, filled with theatrical treats and surprises to extend the magic beyond the curtain call.\r\n- Optional addition of a themed cake or cupcakes, crafted to resemble scenes or characters from beloved theatrical tales.', 599, NULL, 1, '2024-07-05 05:51:43', '2024-07-05 05:51:43'),
(37, 215, 'School Spirit Theater Showcase Package', '', '', '- Transform your school gymnasium or outdoor field into a grand theater setting with vibrant banners, stage props, and dramatic lighting, creating an atmosphere of excitement and anticipation.\r\n- Experience the magic of live performances with a theater production featuring student actors, singers, and dancers showcasing their talents in a captivating show.\r\n- Enjoy carnival-style games and activities with a theatrical twist, including interactive booths inspired by famous plays and musicals, ensuring endless entertainment for everyone.\r\n- Savor a variety of delicious cuisines from our food truck rally, featuring themed treats and snacks to enhance the theatrical experience.\r\n- Showcase student talent in a thrilling talent show or lip-sync battle, where performers can channel their favorite characters or scenes from iconic productions.\r\n- Purchase customized event T-shirts and merchandise adorned with theatrical designs, allowing students to commemorate the day and display their school spirit with pride.', 999, NULL, 1, '2024-07-05 05:53:03', '2024-07-05 05:53:03'),
(38, 215, 'Anchour\'s Frontier Fest Music Experience Package', '', '', '-Dynamic Outdoor Venue: Immerse yourself in the excitement of our vibrant outdoor venue, where multiple stages host live bands and DJs, ensuring non-stop entertainment and showcasing a diverse lineup of musical talent.\r\n-Festival Atmosphere: Get swept away by the lively ambiance of our festival grounds, adorned with captivating art installations and interactive displays that spark conversations and ignite your imagination.\r\n-Culinary Delights Hub: Treat your taste buds to a variety of delectable dishes and snacks at our culinary hub, offering a unique selection of mouthwatering treats and comfort foods to tantalize every palate.\r\n-VIP Oasis: Elevate your festival experience with our VIP ticket option, granting you exclusive access to luxurious lounges, priority entry to attractions, artist meet-and-greets, and VIP amenities. Enjoy the opportunity to mingle with performers and indulge in the festivities in style.\r\n-Festival Keepsakes: Take home a piece of the festival magic with our merchandise booths, offering a curated selection of apparel and memorabilia to commemorate your unforgettable Frontier Fest experience.', 1000, NULL, 1, '2024-07-05 05:53:41', '2024-07-05 05:53:41'),
(39, 216, 'Advanced Industry Immersion', '', '', '-State-of-the-Art Entertainment Venue: Immerse yourself in a cutting-edge entertainment venue equipped with top-of-the-line audiovisual technology, creating the perfect atmosphere for an unforgettable experience.\r\n\r\n-Dynamic DJ Performances: Enjoy electrifying DJ performances that keep the energy high and the dance floor packed all night long. Our talented DJs curate playlists tailored to your event\'s vibe, ensuring every moment is filled with excitement.\r\n\r\n-Interactive Entertainment Experiences: Engage with interactive entertainment experiences that captivate guests and create lasting memories. From live performances to interactive games, there\'s something for everyone to enjoy.\r\n\r\n-Customized Event Packages: Tailor your event with customizable packages that cater to your specific entertainment needs. Whether it\'s a themed party, corporate event, or wedding celebration, we have the perfect entertainment solution for you.\r\n\r\n-Personalized Event Coordination: Relax and enjoy your event while our experienced event coordinators handle all the details. From planning to execution, we ensure a seamless and stress-free experience for you and your guests.', 672, NULL, 1, '2024-07-05 06:05:27', '2024-07-05 06:05:27'),
(40, 216, 'Divine Rhythms Revelry', '', '', '- Sacred Soundscape: Enter a venue transformed into a sanctuary of sound, where divine rhythms and melodies resonate, creating an atmosphere of reverence and joy, inviting all to dance in celebration of unity and faith.\r\n- Spiritual Beats: Experience the uplifting energy of spiritual beats curated by our talented DJs, blending traditional and contemporary sounds in a harmonious fusion that moves the soul and ignites the spirit, elevating the celebration to new heights.\r\n- Enchanting Entertainment: Be enchanted by mesmerizing performances that weave together elements of culture and faith, from traditional dances to sacred rituals, captivating the senses and inspiring awe and wonder in all who behold.\r\n- Divine Dancefloor: Take to the dancefloor and surrender to the rhythm of the divine, as pulsating beats and infectious melodies unite hearts and minds in joyous communion, transcending barriers and fostering a sense of oneness among revelers.\r\n- Soulful Serenity Lounge: Retreat to a serene oasis within the festivities, where soft lighting and tranquil melodies offer moments of introspection and connection, providing a respite for weary souls seeking solace and renewal amidst the revelry.\r\n- Charitable Grooves: Dance with purpose as we unite in support of a meaningful cause through a charity drive or volunteer activity, harnessing the power of music and movement to make a positive impact in the world, spreading love and compassion with every beat.', 777.77, NULL, 1, '2024-07-05 06:06:37', '2024-07-05 06:06:37'),
(41, 216, 'Vibrant Conference Rhythms', '', '', '- Dynamic Venue Atmosphere: Step into a venue pulsating with energy, where modern amenities and state-of-the-art audiovisual equipment set the stage for an electrifying conference experience infused with the beats of music and entertainment.\r\n- Energetic Keynote Performances: Engage with keynote speakers who deliver their messages with flair, blending insightful content with dynamic performances that captivate and inspire, ensuring your conference is not only informative but also unforgettable.\r\n- Networking Lounges with Musical Vibes: Network and collaborate in our dedicated lounges, where the ambiance is infused with lively beats and rhythms, creating the perfect backdrop for productive meetings, spontaneous jam sessions, and vibrant discussions that spark new ideas and connections.\r\n- Interactive Entertainment Expo: Explore interactive expo booths showcasing the latest in entertainment technology, from cutting-edge DJ equipment to innovative stage effects, providing valuable insights and opportunities to connect with industry experts and suppliers.', 899, NULL, 1, '2024-07-05 06:07:23', '2024-07-05 06:07:23'),
(42, 217, 'Advanced Industry Immersion', '', '', '- Immerse yourself in the refined ambiance of our venue, meticulously crafted to elevate professional networking experiences.\r\n- Engage with industry-leading DJs who provide curated music sets, enhancing the atmosphere and fostering dynamic interactions.\r\n- Enjoy insightful keynote speeches or panel discussions by industry experts, complemented by the energizing beats of our talented DJs.\r\n- Spark connections and collaboration through interactive networking games and icebreakers, set to the rhythm of the music.\r\n- Elevate your networking experience with a premium open bar featuring top-shelf liquor and signature cocktails, expertly mixed by our skilled bartenders.\r\n- Savor gourmet hors d\'oeuvres and carving stations, expertly prepared to tantalize your taste buds and impress your guests.\r\n- Leave a lasting impression with branded promotional materials and gift bags, customized to enhance your brand presence and gratitude towards attendees.', 799, NULL, 1, '2024-07-05 06:12:58', '2024-07-05 06:12:58'),
(43, 217, 'Majestic Party Bash', '', '', '- Immerse yourself in the vibrant atmosphere of our themed venue, transformed into the ultimate party destination by Majestic DJs.\r\n- Enjoy an evening of laid-back fun with a variety of entertainment options, including interactive games, dance-offs, and music trivia, all accompanied by the energetic beats of our talented DJs.\r\n- Sip on handcrafted cocktails and mocktails served by our skilled bartenders at the cocktail bar, while grooving to the eclectic mix of music that caters to every taste and preference.\r\n- Indulge your taste buds with a delicious buffet featuring an array of casual fare, from hearty appetizers to satisfying comfort foods and decadent desserts.\r\n- Get ready to compete in friendly challenges and win exciting prizes throughout the night, adding an extra layer of excitement to your party experience.', 999, NULL, 1, '2024-07-05 06:13:39', '2024-07-05 06:13:39'),
(44, 217, 'Majestic Rhythms Celebration', '', '', '- Immerse yourself in a captivating soundscape as our venue transforms into a realm of rhythm and melody, inviting guests to revel in the joy of music and celebration.\r\n- Experience the infectious energy of our talented DJs as they curate an uplifting blend of beats, transcending genres and igniting the dancefloor with their dynamic mixes.\r\n- Be entertained by mesmerizing performances that captivate the senses and inspire awe, showcasing the richness of culture and the power of artistic expression.\r\n- Join fellow revelers on the dancefloor and surrender to the pulse of the music, as hearts unite and spirits soar in a jubilant celebration of life and unity.\r\n- Discover moments of serenity in our tranquil lounge area, where soft lighting and soothing melodies offer a peaceful retreat amidst the excitement of the festivities.\r\n- Dance with purpose as we come together to support meaningful causes through charitable initiatives, harnessing the power of music and movement to spread love and compassion to those in need.', 787.77, NULL, 1, '2024-07-05 06:14:14', '2024-07-05 06:14:14'),
(45, 218, 'Blooming Adventures Package', '', '', '- Venue decoration with vibrant floral arrangements incorporating seasonal flowers and foliage, creating a whimsical and enchanting atmosphere.\r\n- Themed entertainment featuring interactive storytelling sessions amidst floral backdrops, flower crown-making stations where kids can create their own nature-inspired crowns, and a guided exploration of a mini garden filled with blooming flowers.\r\n- Face painting with floral motifs and designs, allowing little ones to transform into their favorite flower or garden creature.\r\n- Flower twisting activities, where skilled artisans create botanical-inspired creations like butterfly flowers or floral bouquets.\r\n- Kid-friendly buffet with a variety of snacks and drinks served amidst floral table centerpieces, featuring floral-infused treats such as lavender lemonade and edible flower cupcakes.\r\n- Blooming goodie bags for all the little adventurers, filled with flower-themed goodies like seed packets, mini succulents, and floral-scented bubbles.\r\n- Option for a themed floral cake or cupcakes adorned with edible flowers, bringing the beauty of the garden to the dessert table.', 499, NULL, 1, '2024-07-05 06:22:35', '2024-07-05 06:22:35'),
(46, 218, 'Blooming Glow Party Package', '', '', '- Neon-themed venue decor with vibrant floral arrangements featuring neon-colored flowers and glowing foliage, creating a lively and colorful atmosphere.\r\n- Floral arch or entrance adorned with neon flowers to welcome guests.\r\n- Dance floor decorated with glowing floral installations and laser lights to enhance the party vibe.\r\n- Mocktail bar serving vibrant non-alcoholic drinks with floral garnishes and glowing drink stirrers.\r\n- Photo booth with funky props, including glow-in-the-dark flower crowns and neon floral backdrops for unique and memorable photos.\r\n- Customized Snapchat filter for the event, featuring neon floral designs and the event\'s name or theme.', 499, NULL, 1, '2024-07-05 06:24:02', '2024-07-05 06:24:02'),
(47, 218, 'Floral Fantasy Night', '', '', '- Themed venue decorated to resemble an elegant garden party with luxurious floral arrangements and centerpieces.\r\n- Interactive floral stations where guests can create their own mini bouquets or floral crafts.\r\n- Customized \"flower currency\" for guests to use at different floral stations.\r\n- Cocktail bar with skilled bartenders crafting floral-inspired drinks, garnished with edible flowers.\r\n- Buffet with upscale finger foods and desserts, beautifully presented with floral decorations.\r\n- Prizes for guests who create the best floral arrangements or win flower-themed games.', 999, NULL, 1, '2024-07-05 06:24:57', '2024-07-05 06:24:57'),
(48, 219, 'Garden Fresh Floral Celebration', '', '', '-Immerse yourself in the natural beauty of freshly-picked blooms with our Blossom & Bubbly --Celebration package.\r\n-Transform your venue into a blooming paradise with stunning floral arrangements.\r\n-Sip on exquisite champagne amidst the enchanting fragrance of the garden.\r\n-Capture unforgettable moments against picturesque floral backdrops.\r\n-Perfect for engagement parties and garden celebrations.\r\n-Offers a simple yet elegant experience where the beauty of nature and the sparkle of champagne come together to create an enchanting atmosphere for your special moments.', 599, NULL, 1, '2024-07-05 06:32:08', '2024-07-05 06:32:08'),
(49, 219, 'Floral Networking SoirÃ©e by Petal Perfection Florals', '', '', '-Blossoming Venue: Transform your venue into a blooming paradise with exquisite floral arrangements created by our skilled florists, setting the stage for meaningful networking interactions and business collaborations amidst the captivating beauty of fresh blooms.\r\n\r\n-Expert Floral Engagements: Engage with industry thought leaders amidst stunning floral backdrops, where captivating keynote speeches and insightful panel discussions are complemented by the enchanting ambiance of our floral designs, offering valuable insights and opportunities for learning and growth.\r\n\r\n-Interactive Floral Networking Activities: Foster connections and collaboration with tailored networking games and icebreakers incorporating floral elements, designed exclusively by our florists to spark conversation and create memorable interactions among attendees.\r\n\r\n-Floral-infused Beverage Experience: Indulge in our floral-inspired beverage menu, featuring handcrafted cocktails infused with botanical flavors and garnished with delicate floral accents, expertly crafted by our florist mixologists to enhance the networking experience with a touch of floral elegance.\r\n\r\n-Branded Floral Promotional Materials: Enhance your brand presence with branded promotional materials and gift bags adorned with floral motifs, exclusively designed and curated by our florists to leave a lasting impression on attendees, showcasing your company\'s commitment to excellence and attention to detail.', 999, NULL, 1, '2024-07-05 06:32:44', '2024-07-05 06:32:44'),
(50, 219, 'Masquerade Magic Highlights', '', '', '- Enchanting Ambiance: Our elegant venue is adorned with masks, feathers, and drapes, transporting you to a world of mystery and intrigue.\r\n- Captivating Entertainment: Dance the night away to sultry tunes spun by a live band or DJ, adding to the allure of the evening.\r\n- VIP Experience: Retreat to our exclusive VIP lounge area, where bottle service and exclusive entertainment await to elevate your experience.\r\n- Exotic Libations: Indulge in specialty drinks from our exotic cocktail bar, expertly crafted to tantalize your senses and complement the ambiance.\r\n- Glamorous Photo Opportunities: Strike a pose at our themed photo booth, adorned with glamorous props to capture the magic of the night.\r\n- Sensational Performances: Be mesmerized by sensual burlesque or cabaret performances, adding an element of sophistication and excitement to the evening.', 699, NULL, 1, '2024-07-05 06:33:21', '2024-07-05 06:33:21'),
(51, 220, 'Professional Development Floral Catering Package', '', '', '-Keynote Speaker Stage Decor: Impress your attendees with tasteful floral arrangements adorning the keynote speaker stage, creating a visually appealing backdrop for industry insights and presentations.\r\n\r\n-Networking Lounge Floral Accents: Create inviting and comfortable networking lounges with floral accents, providing designated meeting areas for productive interactions and connections.\r\n\r\n-Expo Booth Floral Displays: Enhance the aesthetics of your expo booths with eye-catching floral displays, attracting attendees and adding a touch of elegance to the showcase of products and services.\r\n\r\n-Buffet Floral Centerpieces: Elevate your buffet-style lunch with stunning floral centerpieces, featuring fresh blooms that complement the healthy options and dietary accommodations provided.', 699, NULL, 1, '2024-07-05 06:50:20', '2024-07-05 06:50:20'),
(52, 220, 'Floral Enhancement Package for Awards and Graduation Ceremonies', '', '', '-Venue Beautification: Transform your awards and graduation ceremony venue into a picturesque setting with modern elegance, providing the perfect backdrop to showcase exquisite floral arrangements.\r\n\r\n-Floral Displays: Enrich the ambiance of your ceremony with captivating floral displays strategically positioned throughout the venue, enhancing both the aesthetic appeal and the natural beauty of the surroundings.\r\n\r\n-Networking Lounges with Floral Touches: Foster meaningful connections and interactions among guests in inviting networking lounges adorned with tasteful floral accents, creating an atmosphere conducive to collaboration and camaraderie.\r\n\r\n-Custom Floral Centerpieces: Delight your guests with personalized floral centerpieces adorning tables during breaks and meals, elevating the dining experience with a touch of elegance and charm.', 899, NULL, 1, '2024-07-05 06:51:02', '2024-07-05 06:51:02'),
(53, 220, 'Adaptable Floral Conference Package', '', '', '-Venue Beautification: Host your floral conference in a modern venue with the perfect ambiance to showcase floral arrangements, ensuring your event is as beautiful as it is informative.\r\n\r\n-Floral Displays: Enhance your conference with captivating floral displays strategically placed throughout the venue, providing both aesthetic appeal and a sense of natural beauty.\r\n\r\n-Networking Lounges with Floral Accents: Create inviting spaces for networking and collaboration with lounge areas adorned with tasteful floral accents, fostering connections among attendees.\r\n\r\n-Customized Floral Centerpieces: Impress your guests with bespoke floral centerpieces adorning tables during breaks and meals, adding elegance and charm to the dining experience.', 899, NULL, 1, '2024-07-05 06:51:49', '2024-07-05 06:51:49'),
(54, 221, 'Floral Festival Experience Package', '', '', '-Floral Venue Transformation: Step into our dynamic outdoor venue transformed into a floral wonderland, with colorful blooms and enchanting floral installations adorning multiple stages and festival areas.\r\n\r\n-Floral Art Installations: Immerse yourself in the vibrant atmosphere of our festival grounds, embellished with captivating floral art installations and interactive displays that ignite imagination and inspire conversation.\r\n\r\n-Culinary Flower Garden: Explore our floral-themed food truck village, where a tantalizing array of culinary delights awaits, each dish infused with floral flavors and presented amidst a garden of blooms.\r\n\r\n-Botanical Beverage Oasis: Quench your thirst at our craft floral beverage garden, where you can sample a selection of floral-infused cocktails, mocktails, and artisanal floral teas, each sip a celebration of nature\'s bounty.\r\n\r\n-Blossoming VIP Experience: Elevate your festival journey with our Blossoming VIP ticket option, granting you exclusive access to floral-themed lounges and artist meet-and-greets, allowing you to mingle with performers and enjoy VIP amenities amidst lush floral surroundings.\r\n\r\n-Floral Merchandise Haven: Don\'t miss the opportunity to take home a piece of the floral festival magic with our merchandise booths, offering a curated selection of floral-themed apparel and memorabilia to commemorate your blooming experience.', 399, NULL, 1, '2024-07-05 07:55:11', '2024-07-05 07:55:11'),
(55, 221, 'Floral Community Celebration Package', '', '', '-Venue Beautification: Transform our venue into a floral paradise adorned with vibrant blooms and cultural decor, creating a welcoming and inclusive atmosphere for all attendees to celebrate together.\r\n\r\n-Floral Ceremony Enhancement: Enhance the beauty of your religious ceremony with floral arrangements and symbolism, fostering spiritual unity and reflection amidst the natural splendor.\r\n\r\n-Culinary Floral Feast: Indulge in a culinary experience featuring traditional dishes adorned with edible flowers, a sensory delight that celebrates cultural heritage and the beauty of nature\'s bounty.\r\n\r\n-Floral Entertainment Showcase: Be captivated by cultural performances or religious music surrounded by floral splendor, showcasing the rich tapestry of talent within our community and inspiring hearts and minds.\r\n\r\n-Tranquil Floral Retreat: Find solace and connection in our dedicated floral meditation space, offering a serene retreat for personal reflection and spiritual renewal amidst the vibrant festivities.\r\n\r\n-Floral Community Outreach: Give back to the community with a charity drive or volunteer activity focused on floral initiatives, uniting together to support a meaningful cause and make a positive impact in the world.', 499, NULL, 1, '2024-07-05 07:55:56', '2024-07-05 07:55:56'),
(56, 221, 'Floral School Spirit Extravaganza Package', '', '', '-Floral School Decor: Transform your school gymnasium or outdoor field with vibrant floral banners, mascots, and arrangements in your school colors, creating an atmosphere of unity and enthusiasm infused with the beauty of flowers.\r\n\r\n-Floral Music Atmosphere: Dance the day away surrounded by floral beauty with a DJ or live band playing popular music amidst stunning floral arrangements, setting the perfect backdrop for a high-energy celebration filled with school spirit.\r\n\r\n-Floral Carnival Fun: Enjoy carnival-style games and activities amidst floral-themed decor, including dunk tanks, ring toss, and more, ensuring endless fun for everyone amidst the natural beauty of floral surroundings.\r\n\r\n-Floral Food Truck Delights: Savor a variety of delicious cuisines from our floral-themed food truck rally, featuring student-favorite foods infused with floral flavors to satisfy every craving and add to the festive floral atmosphere.\r\n\r\n-Floral Talent Showcase: Showcase the diverse talents of your school community amidst floral splendor with a thrilling talent show or lip-sync battle, highlighting the unique skills and creativity of students amidst floral arrangements and decor.\r\n\r\n-Floral Event Merchandise: Purchase customized event T-shirts and merchandise adorned with floral designs to commemorate the day and show off your school spirit with pride amidst the floral celebration.', 999, NULL, 1, '2024-07-05 07:56:42', '2024-07-05 07:56:42'),
(57, 222, 'Neon Night Floral Extravaganza Package', '', '', '-Floral Neon-Themed Decor: Immerse yourself in a neon wonderland adorned with vibrant floral arrangements complemented by UV lights and glow sticks, creating an electrifying atmosphere pulsating with energy and natural beauty.\r\n\r\n-Enthralling Floral Dance Floor: Illuminate the night with a dance floor enhanced by fog machines and laser lights, surrounded by enchanting floral arrangements, transforming every move into a mesmerizing display of neon colors and natural beauty.\r\n\r\n-Floral Photo Booth Fun: Capture the memories with friends amidst stunning floral backdrops at our neon-themed photo booth, complete with fun props and floral accents that add an extra element of excitement to your snapshots.\r\n\r\n-Customized Floral Snapchat Filter: Share the excitement with a custom Snapchat filter designed exclusively for the event, featuring floral motifs that allow guests to snap and share their neon night floral experience with friends.', 1000, NULL, 1, '2024-07-05 08:02:24', '2024-07-05 08:02:24'),
(58, 222, 'Joyful Wedding Blissge', '', '', '- Enter a venue brimming with joy, adorned with twinkling lights, vibrant florals, and breezy drapery, setting the scene for your blissful wedding celebration.\r\n- Serenade your guests with the uplifting melodies of a live band or acoustic guitarist, filling the air with music that radiates happiness and love during both the ceremony and cocktail hour.\r\n- Raise your glasses in a toast to everlasting joy and laughter with a champagne toast, followed by a scrumptious assortment of hors d\'oeuvres that tickle the taste buds and spread smiles all around.\r\n- Indulge in a delightful multi-course plated dinner, featuring a selection of mouthwatering dishes crafted to your liking, ensuring a culinary experience that delights and satisfies.\r\n- Relax and bask in the happiness of your special day, knowing that our experienced wedding planner is on hand to handle every detail, ensuring a stress-free celebration that allows you to focus on what truly matters - each other.\r\n- Send your guests home with hearts full of happiness and memories to cherish, thanks to personalized wedding favors and a guestbook filled with well wishes and love, capturing the joy of your wedding day for years to come.', 409, NULL, 1, '2024-07-05 08:03:06', '2024-07-05 08:03:06'),
(59, 222, 'Blossoming School Spirit Celebration Package', '', '', '-Floral School Decor: Elevate your school gymnasium or outdoor field with vibrant floral banners, mascots, and arrangements in your school colors, creating an atmosphere of unity and enthusiasm amidst a blooming floral landscape.\r\n\r\n-Floral Music Atmosphere: Dance amidst the beauty of flowers with a DJ or live band playing popular tunes surrounded by stunning floral arrangements, setting the stage for a lively celebration filled with school spirit.\r\n\r\n-Floral Carnival Fun: Enjoy carnival-style games and activities amidst enchanting floral decor, including dunk tanks, ring toss, and more, ensuring endless fun for everyone amidst the natural beauty of floral surroundings.\r\n\r\n-Floral Gastronomic Delights: Indulge in a variety of delicious cuisines from our floral-themed food truck rally, featuring student-favorite foods infused with floral flavors to satisfy every craving and add to the festive floral atmosphere.\r\n\r\n-Floral Talent Showcase: Highlight the diverse talents of your school community amidst floral splendor with a captivating talent show or lip-sync battle, showcasing the unique skills and creativity of students amidst floral arrangements and decor.\r\n\r\n-Blossoming Event Merchandise: Purchase customized event T-shirts and merchandise adorned with floral designs to commemorate the day and showcase your school spirit with pride amidst the blossoming celebration.', 979, NULL, 1, '2024-07-05 08:04:07', '2024-07-05 08:04:07'),
(60, 223, 'Community Celebration Package', '', '', '- Welcoming venue with religious symbolism and cultural decor.\r\n   - Religious ceremony officiated by a respected leader or clergy member.\r\n   - Community potluck or catered dinner with traditional dishes.\r\n   - Cultural performances or religious music performances.\r\n   - Prayer or meditation space for reflection and connection.\r\n   - Charity drive or volunteer activity to support a meaningful cause.', 399, NULL, 1, '2024-07-05 08:11:05', '2024-07-05 08:11:05'),
