(62, 223, 'Sensational SoirÃ©e Experience', '', '', '- Upscale venue with chic decor and lounge areas for mingling.\r\n- Live band or DJ spinning a mix of classic hits and current chart-toppers.\r\n- Craft cocktail bar with skilled mixologists creating custom drinks.\r\n- Gourmet food stations showcasing international cuisines and culinary delights.\r\n- Interactive entertainment options like a casino table or karaoke setup.\r\n- Stylish photo booth with elegant props and digital sharing options.', 999, NULL, 1, '2024-07-05 08:12:48', '2024-07-05 08:12:48'),
