(69, 226, 'Destination Dream Wedding', '', '', '- Exotic beach or picturesque destination venue for a dreamy backdrop.\r\n   - Personalized ceremony overlooking the ocean or scenic landscape.\r\n   - Reception with a tropical-themed menu featuring fresh seafood and island delicacies.\r\n   - Sunset cocktail hour with signature drinks and live music.\r\n   - Beach bonfire or lantern release for a romantic touch.\r\n   - Honeymoon suite or luxury villa accommodat', 45, NULL, 1, '2024-07-05 08:31:59', '2024-07-05 08:31:59'),
(70, 226, 'Masquerade Ball Extravaganza', '', '', '- Elegant venue adorned with masks, feathers, and drapes.\r\n   - Live band or DJ playing sultry tunes for dancing.\r\n   - VIP lounge area with bottle service and exclusive entertainment.\r\n   - Exotic cocktail bar serving specialty drinks.\r\n   - Themed photo booth with glamorous props.\r\n   - Sensual burlesque or cabaret performance.', 123, NULL, 1, '2024-07-05 08:32:30', '2024-07-05 08:32:30'),
(71, 226, 'Innovation Expo Experience', '', '', '- Dynamic expo floor layout with themed zones and interactive displays.\r\n   - Product demonstrations and hands-on workshops.\r\n   - Startup pitch competition or innovation awards ceremony.\r\n   - Catered reception with artisanal food stations and craft beer tastings.\r\n   - Networking roundtables focused on specific topics or industries.\r\n   - Swag bags with promotional items and informational materials.', 125, NULL, 1, '2024-07-05 08:33:13', '2024-07-05 08:33:13'),
(72, 227, 'Music Festival Experience', '', '', '- Outdoor venue with multiple stages featuring live bands and DJs.\r\n   - Art installations and interactive displays throughout the festival grounds.\r\n   - Food truck village offering a diverse array of culinary delights.\r\n   - Craft beer garden showcasing local breweries.\r\n   - VIP ticket option with exclusive access to lounges and artist meet-and-greets.\r\n   - Festival merchandise booths selling apparel and memorabilia.', 443, NULL, 1, '2024-07-05 08:36:42', '2024-07-05 08:36:42'),
(73, 227, 'Scholarly Achievement Gala', '', '', '- Grand ballroom or prestigious venue decorated with academic regalia and school colors.\r\n   - Formal dinner with gourmet cuisine and wine pairings.\r\n   - Recognition ceremony honoring academic achievements and outstanding contributions.\r\n   - Inspirational keynote speech by a distinguished guest or alumni.\r\n   - Professional photography services capturing memorable moments.\r\n   - After-party with live entertainment and dancing to celebrate accomplishments.', 345, NULL, 1, '2024-07-05 08:38:10', '2024-07-05 08:38:10'),
(74, 227, 'Chic Cocktail Affair', '', '', '- Trendy venue with modern decor and ambient lighting.\r\n   - Cocktail-style reception with passed hors d\'oeuvres and specialty drinks.\r\n   - Live music or acoustic performance for a relaxed atmosphere.\r\n   - Interactive photo booth with props and customized photo strips.\r\n   - Personalized engagement party favors for guests.\r\n   - Toast and speeches to celebrate the happy couple.', 22.2, NULL, 1, '2024-07-05 08:39:00', '2024-07-05 08:39:00'),
(75, 228, 'Little Explorers Package', '', '', '- Venue decoration with colorful balloons and banners.\r\n- Themed entertainment such as magic shows, puppet shows, or clown performances.\r\n- Face painting and balloon twisting activities.\r\n- Kid-friendly buffet with a variety of snacks and drinks.\r\n- Goodie bags for all the little guests.\r\n- Option for a themed cake or cupcakes.', 399, NULL, 1, '2024-07-05 08:44:03', '2024-07-05 08:44:03'),
(76, 228, 'Game Zone Extravaganza', '', '', '- Access to a gaming lounge with consoles, VR setups, and arcade machines.\r\n   - Tournament-style competitions with prizes for winners.\r\n   - Buffet featuring teen favorites like sliders, nachos, and milkshakes.\r\n   - DIY cupcake decorating station.\r\n   - Social media photo contest with a hashtag unique to the event.', 499, NULL, 1, '2024-07-05 08:45:18', '2024-07-05 08:45:18'),
(77, 228, 'Cake Casino Package', '', '', '-Themed Display: Set up a themed cake display inspired by the excitement of a casino. Think edible decorations like cards and dice to catch your customers\' eyes.\r\n-interactive Stations: Let customers decorate their own cakes with casino-themed toppings. It\'s a hands-on way to add a bit of fun to their bakery visit.\r\n-Sweet Tokens: Treat your customers with edible \"sweet money\" tokens, like mini casino chips. They can redeem these for discounts or free samples.\r\n-Cocktail Flavors: Add cocktail-inspired flavors to your cakes, like chocolate martini or mojito. It\'s a tasty way to tie into the casino theme.\r\n-Prize Draws: Hold prize drawings for your customers â it\'s a simple way to add excitement and reward loyalty.', 999, NULL, 1, '2024-07-05 08:46:44', '2024-07-05 08:46:44'),
(78, 229, 'Little Explorers Package', '', '', '-Themed Entertainment: Delight your little explorers with captivating performances such as magic shows, puppet shows, or clown acts. Watch as their faces light up with joy and amazement at the magical wonders unfolding before their eyes.\r\n-Creative Activities: Let their imaginations soar with face painting and balloon twisting activities. From whimsical face designs to intricate balloon creations, they\'ll have a blast expressing their creativity and transforming into their favorite characters.\r\n-Kid-Friendly Buffet: Treat your young adventurers to a delicious buffet featuring a variety of snacks and drinks. From finger foods to sweet treats, our kid-friendly menu is sure to satisfy even the pickiest of eaters.\r\n-Goodie Bags: Send your little guests home with memories to treasure and goodies to enjoy. Our goodie bags are filled with surprises and treats, ensuring that the fun continues long after the party is over.\r\n-Themed Cake or Cupcakes: Complete the adventure with a themed cake or cupcakes that will leave a lasting impression. Whether it\'s a whimsical cake depicting their favorite characters or a selection of themed cupcakes, our sweet treats will be the perfect finale to their epic journey.', 399, NULL, 1, '2024-07-05 09:03:00', '2024-07-05 09:03:00'),
(79, 229, 'Cake Casino Package', '', '', '-Themed Display: Set up a themed cake display inspired by the excitement of a casino. Think edible decorations like cards and dice to catch your customers\' eyes.\r\n\r\n-Interactive Stations: Let customers decorate their own cakes with casino-themed toppings. It\'s a hands-on way to add a bit of fun to their bakery visit.\r\n\r\n-Sweet Tokens: Treat your customers with edible \"sweet money\" tokens, like mini casino chips. They can redeem these for discounts or free samples.\r\n\r\n-Cocktail Flavors: Add cocktail-inspired flavors to your cakes, like chocolate martini or mojito. It\'s a tasty way to tie into the casino theme.\r\n\r\n-Prize Draws: Hold prize drawings for your customers â it\'s a simple way to add excitement and reward loyalty.', 999, NULL, 1, '2024-07-05 09:06:13', '2024-07-05 09:06:13'),
(80, 229, 'Candy Wonderland Package', '', '', '-Colorful Display: Set up a vibrant, candy-themed cake display with eye-catching decorations like candy canes, lollipops, and gumdrops.\r\n\r\n-DIY Candy Cake Stations: Let customers decorate their own cakes with a variety of colorful candies and sweet toppings. A fun, interactive experience for all ages.\r\n\r\n-Candy Coins: Treat your customers with edible candy coins that they can redeem for discounts or free samples.\r\n\r\n-Candy Flavors: Offer unique cake flavors inspired by classic candies, such as cotton candy, bubblegum, and caramel apple.\r\n\r\n-Surprise Treat Bags: Give out surprise treat bags filled with an assortment of candies to delight your customers.', 345, NULL, 1, '2024-07-05 09:06:57', '2024-07-05 09:06:57'),
(81, 230, 'Little Explorers Package', '', '', '-Venue Decoration: Transform the venue with colorful balloons and banners, creating a vibrant and festive atmosphere.\r\n\r\n-Themed Entertainment: Delight the kids with magic shows, puppet shows, or clown performances tailored to captivate their imaginations.\r\n\r\n-Face Painting & Balloon Twisting: Keep the little ones entertained with fun face painting and creative balloon twisting activities.\r\n\r\n-Kid-Friendly Buffet: Enjoy a variety of snacks and drinks designed specifically for kids, ensuring they stay energized and happy.\r\n\r\n-Goodie Bags: Each little guest will receive a goodie bag filled with fun surprises to take home.\r\n\r\n-Themed Cake or Cupcakes: Choose from a themed cake or cupcakes to add a sweet touch to the celebration.', 399, NULL, 1, '2024-07-05 09:13:48', '2024-07-05 09:13:48'),
(82, 230, 'Joyful Wedding Blissge', '', '', '-Venue of Sweet Joy: Step into a venue adorned with twinkling lights, vibrant florals, and breezy drapery, all with a cake-themed touch, setting the scene for your blissful wedding celebration.\r\n\r\n-Musical Harmony: Serenade your guests with uplifting melodies performed by a live band or acoustic guitarist, filling the air with sweet music throughout the ceremony and cocktail hour.\r\n\r\n-Champagne Toast & Cake Delights: Raise your glasses in a toast to everlasting joy and laughter with a champagne toast, followed by a scrumptious assortment of cake-inspired hors d\'oeuvres that tickle the taste buds and spread smiles all around.\r\n\r\nMulti-Tiered Cake Creations: Indulge in a delightful multi-tiered wedding cake, featuring mouthwatering flavors crafted to your liking, ensuring a culinary experience that delights and satisfies.\r\n\r\n-Stress-Free Planning: Relax and bask in the happiness of your special day, knowing that our experienced cake wedding planner is on hand to handle every detail, ensuring a stress-free celebration that allows you to focus on what truly matters - each other.\r\n\r\n-Sweet Memories & Cake Favors: Send your guests home with hearts full of happiness and memories to cherish, thanks to personalized cake-themed wedding favors and a guestbook filled with well wishes and love, capturing the joy of your wedding day for years to come.', 409, NULL, 1, '2024-07-05 09:14:30', '2024-07-05 09:14:30'),
(83, 230, 'Blossoming School Spirit Celebration', '', '', '-Floral School Decor: Transform your school gymnasium or outdoor field with vibrant floral banners, mascots, and arrangements in your school colors, creating an atmosphere of unity and enthusiasm infused with the beauty of flowers.\r\n\r\nFloral Music Atmosphere: Dance the day away surrounded by floral beauty with a DJ or live band playing popular music amidst stunning floral arrangements, setting the perfect backdrop for a high-energy celebration filled with school spirit.\r\n\r\n-Floral Carnival Fun: Enjoy carnival-style games and activities amidst floral-themed decor, including dunk tanks, ring toss, and more, ensuring endless fun for everyone amidst the natural beauty of floral surroundings.\r\n\r\nFloral Food Truck Delights: Savor a variety of delicious cuisines from our floral-themed food truck rally, featuring student-favorite foods infused with floral flavors to satisfy every craving and add to the festive floral atmosphere.\r\n\r\n-Floral Cake Delicacies: Indulge in a variety of delectable floral-themed cakes, cupcakes, and desserts, specially crafted to complement the celebration and delight every palate with sweet floral flavors.\r\n\r\nFloral Talent Showcase: Showcase the diverse talents of your school community amidst floral splendor with a thrilling talent show or lip-sync battle, highlighting the unique skills and creativity of students amidst floral arrangements and decor.\r\n\r\n-Floral Event Merchandise: Purchase customized event T-shirts and merchandise adorned with floral designs to commemorate the day and show off your school spirit with pride amidst the floral celebration.', 999, NULL, 1, '2024-07-05 09:15:17', '2024-07-05 09:15:17'),
(84, 231, 'Floral Community Celebration Package', '', '', '-Venue Beautification: Transform our venue into a delightful confectionery paradise adorned with colorful cakes, cupcakes, and sweet treats, creating a warm and inviting atmosphere for all attendees to celebrate together.\r\n\r\n-Baker\'s Cake Creations: Enhance the beauty of your celebration with a variety of themed cakes, cupcakes, and desserts, each crafted with care and creativity to add sweetness and joy to your event.\r\n\r\n-Culinary Sweet Feast: Indulge in a culinary experience featuring a delectable assortment of traditional and innovative baked goods, satisfying every palate and celebrating the artistry of baking.\r\n\r\n-Sweet Entertainment Showcase: Be enchanted by performances or live music surrounded by sweet delights, showcasing the diverse talents within our community and inspiring hearts and minds.\r\n\r\n-Tranquil Baker\'s Retreat: Find relaxation and connection in our dedicated baking retreat space, offering a cozy haven for personal reflection and sweet renewal amidst the festivities.\r\n\r\n-Baker\'s Community Outreach: Give back to the community with a charity drive or volunteer activity focused on baking initiatives, uniting together to support a meaningful cause and spread the joy of baking.', 499, NULL, 1, '2024-07-05 09:26:10', '2024-07-05 09:26:10'),
(85, 231, 'Elegant Celebration Enhancement Package', '', '', '-Venue Transformation: Elevate your awards and graduation ceremony venue with a touch of modern elegance, providing a picturesque setting to showcase the achievements of your graduates with exquisite cake displays and tasteful decor.\r\n\r\n-Cake Adornments: Enrich the ambiance of your ceremony with captivating cake displays strategically positioned throughout the venue, enhancing both the aesthetic appeal and the celebratory atmosphere.\r\n\r\n-Networking Lounges with Sweet Treats: Foster meaningful connections and interactions among guests in inviting networking lounges adorned with delightful sweet treats, creating an atmosphere conducive to collaboration and camaraderie.\r\n\r\n-Customized Cake Creations: Delight your guests with personalized cake creations adorning tables during breaks and meals, elevating the dining experience with a touch of sweetness and charm.', 899, NULL, 1, '2024-07-05 09:26:54', '2024-07-05 09:26:54'),
(86, 231, 'Sophisticated Industry Mixer Package', '', '', '-Refined Venue Setting: Immerse yourself in the refined ambiance of our venue, meticulously crafted to elevate professional networking experiences with exquisite cake displays and tasteful decor.\r\n\r\n-Dynamic Music Sets: Engage with industry-leading DJs who provide curated music sets, enhancing the atmosphere and fostering dynamic interactions amidst the sweet melodies.\r\n\r\n-insightful Keynotes & DJ Beats: Enjoy insightful keynote speeches or panel discussions by industry experts, complemented by the energizing beats of our talented DJs, creating a harmonious blend of knowledge and entertainment.\r\n\r\n-Interactive Networking Games: Spark connections and collaboration through interactive networking games and icebreakers, set to the rhythm of the music, adding excitement to your networking experience.\r\n\r\n-Premium Cake Bar & Gourmet Treats: Elevate your networking experience with a premium cake bar featuring a variety of cake flavors and toppings, expertly mixed by our skilled bakers. Savor gourmet hors d\'oeuvres and carving stations, expertly prepared to tantalize your taste buds and impress your guests.\r\n\r\n-Branded Sweet Treats & Gift Bags: Leave a lasting impression with branded sweet treats and gift bags, customized to enhance your brand presence and gratitude towards attendees, ensuring a memorable and delightful experience for all.', 799, NULL, 1, '2024-07-05 09:27:43', '2024-07-05 09:27:43'),
(87, 232, 'Professional Development Sweet Catering Package', '', '', '-Keynote Speaker Stage Sweet Decor: Impress your attendees with tasteful cake arrangements adorning the keynote speaker stage, creating a visually appealing backdrop for industry insights and presentations.\r\n\r\n-Networking Lounge Sweet Accents: Create inviting and comfortable networking lounges with sweet accents, providing designated meeting areas for productive interactions and connections amidst the delightful ambiance.\r\n\r\n-Expo Booth Sweet Displays: Enhance the aesthetics of your expo booths with eye-catching cake displays, attracting attendees and adding a touch of sweetness to the showcase of products and services.\r\n\r\n-Buffet Sweet Centerpieces: Elevate your buffet-style lunch with stunning cake centerpieces, featuring delicious creations that complement the healthy options and dietary accommodations provided, ensuring a delightful culinary experience for all.Price:Starting at $699', 699, NULL, 1, '2024-07-05 09:34:03', '2024-07-05 09:34:03'),
(88, 232, 'Sweet School Spirit Bash', '', '', '-School Gymnasium or Outdoor Field Cake Transformation: Watch as banners and mascots are replaced with delicious cake displays and colorful confectionery, transforming your school into a sweet paradise.\r\n\r\n-Sweet Beats: Dance the day away to the tunes of a DJ or live band playing sweet melodies, adding a sugary touch to the celebration.\r\n\r\n-Sweet Carnival Fun: Enjoy carnival-style games and activities like dunk tanks and ring toss, but with a twist - they\'re all inspired by sweet treats!\r\n\r\n-Sweet Food Truck Rally: Indulge in a variety of student-favorite sweet cuisines from our food truck rally, satisfying every craving and adding to the sugary atmosphere.\r\n\r\n-Sweet Talent Showcase: Be amazed by the talents of your fellow students in a talent show or lip-sync battle, showcasing the creativity and sweetness of your school community.\r\n\r\n-Sweet Event Merchandise: Get your hands on customized event T-shirts and merchandise adorned with sweet designs, perfect for showing off your school spirit long after the celebration ends.', 123, NULL, 1, '2024-07-05 09:35:24', '2024-07-05 09:35:24'),
(89, 232, 'Sweet Music Festival Affair', '', '', '-Cake Garden Oasis: Immerse yourself in a cake-filled wonderland with multiple stages featuring live bands and DJs, providing a sweet symphony for your senses.\r\n\r\n-Artful Cake Displays: Explore art installations and interactive cake displays throughout the festival grounds, adding a touch of sweetness to every corner.\r\n\r\n-Food Truck Wonderland: Indulge in a diverse array of culinary delights from our food truck village, where every bite is a sweet sensation.\r\n\r\n-Craft Cake Garden: Sip on delicious creations from local breweries in our craft cake garden, offering a variety of sweet brews to tickle your taste buds.\r\n\r\n-VIP Cake Experience: Upgrade to a VIP ticket for exclusive access to cake lounges and artist meet-and-greets, ensuring your festival experience is as sweet as can be.\r\n\r\nCake Merchandise Bliss: Shop till you drop at our festival merchandise booths, where you can find sweet apparel and memorabilia to commemorate your unforgettable cake-filled experience.', 443, NULL, 1, '2024-07-05 09:36:21', '2024-07-05 09:36:21'),
(90, 233, 'Little Explorers Decor Deal', '', '', '-Venue decoration with colorful balloons and banners.\r\n-Themed centerpieces for tables.\r\n-Coordinated tablecloth and tableware.\r\n-Personalized goodie bags for all the little guests.\r\n-Option for themed cake or cupcakes.', 399, NULL, 1, '2024-07-05 12:24:42', '2024-07-05 12:24:42'),
(91, 233, 'Glow Party Decor Deal', '', '', '-Enchanting starry night venue decor with twinkling lights and celestial-themed accents.\r\n-DJ booth with a professional DJ playing the latest hits.\r\n-Dance floor with fog machines and colorful LED lights.\r\n-Mocktail bar serving vibrant non-alcoholic drinks.\r\n-Photo booth with celestial-themed props.\r\n-Customized Snapchat filter for the event.', 499, NULL, 1, '2024-07-05 12:25:31', '2024-07-05 12:25:31'),
(92, 233, 'Casino Night Decor & Entertainment Deal', '', '', '-Themed venue decorated to resemble a high-end casino.\r\n-Professional dealers at blackjack, poker, and roulette tables.\r\n-Customized \"fun money\" for guests to play with.\r\n-Cocktail bar with skilled bartenders crafting classic drinks.\r\n-Buffet with upscale finger foods and desserts.\r\n-Prizes for top players at the end of the night.', 999, NULL, 1, '2024-07-05 12:26:15', '2024-07-05 12:26:15'),
(93, 234, 'Sumptuous Feast & Celebration Decor Package', '', '', '-Tailored, multi-course feast in our elegant dining area, complete with ambient lighting.\r\n-Champagne toast to celebrate your milestones.\r\n-Live music or DJ to set the mood for dancing.\r\n-Professional photography services to capture precious moments.\r\n-Personalized party favors for guests to take home.', 599, NULL, 1, '2024-07-05 12:39:59', '2024-07-05 12:39:59'),
(94, 234, 'Professional Networking Soiree Decor Experience', '', '', '-Elevate your networking event with sophisticated decor designed for a professional ambiance.\r\n-Set the tone with stylish table linens and elegant chair covers.\r\n-Create a branded backdrop featuring your company logo for photo opportunities.\r\n-Enhance the ambiance with strategic lighting to create a warm and inviting atmosphere.\r\n-Add subtle touches of professionalism with tasteful floral arrangements and greenery.', 799, NULL, 1, '2024-07-05 12:40:55', '2024-07-05 12:40:55'),
(95, 234, 'Masquerade Magic Decor & Entertainment Experience', '', '', '-Enchanting Ambiance: Our elegant venue is adorned with masks, feathers, and drapes, transporting you to a world of mystery and intrigue.\r\n-Captivating Entertainment: Dance the night away to sultry tunes spun by a live band or DJ, adding to the allure of the evening.\r\n-VIP Experience: Retreat to our exclusive VIP lounge area, where bottle service and exclusive entertainment await to elevate your experience.\r\n-Exotic Libations: Indulge in specialty drinks from our exotic cocktail bar, expertly crafted to tantalize your senses and complement the ambiance.\r\n-Glamorous Photo Opportunities: Strike a pose at our themed photo booth, adorned with glamorous props to capture the magic of the night.\r\n-Sensational Performances: Be mesmerized by sensual burlesque or cabaret performances, adding an element of sophistication and excitement to the evening.', 699, NULL, 1, '2024-07-05 12:41:56', '2024-07-05 12:41:56'),
(96, 235, 'Blossom Festival Experience Package', '', '', '-Botanical Venue Transformation: Step into our dynamic outdoor venue transformed into a floral wonderland, with colorful blooms and enchanting botanical installations adorning multiple stages and festival areas.\r\n\r\n-Botanical Art Installations: Immerse yourself in the vibrant atmosphere of our festival grounds, embellished with captivating botanical art installations and interactive displays that ignite imagination and inspire conversation.\r\n\r\n-Culinary Flower Garden: Explore our floral-themed food truck village, where a tantalizing array of culinary delights awaits, each dish infused with botanical flavors and presented amidst a garden of blooms.\r\n\r\n-Botanical Beverage Oasis: Quench your thirst at our craft floral beverage garden, where you can sample a selection of botanical-infused cocktails, mocktails, and artisanal floral teas, each sip a celebration of nature\'s bounty.\r\n\r\n-Blossoming VIP Experience: Elevate your festival journey with our Blossoming VIP ticket option, granting you exclusive access to botanical-themed lounges and artist meet-and-greets, allowing you to mingle with performers and enjoy VIP amenities amidst lush botanical surroundings.\r\n\r\n-Floral Merchandise Haven: Don\'t miss the opportunity to take home a piece of the festival magic with our merchandise booths, offering a curated selection of floral-themed apparel and memorabilia to commemorate your blooming experience.', 399, NULL, 1, '2024-07-05 12:55:10', '2024-07-05 12:55:10'),
(97, 235, 'Tech Innovation Summit Decor & Experience Package', '', '', '-Cutting-edge convention center or technology hub with advanced facilities.\r\n-Keynote presentations and panel discussions by industry pioneers and thought leaders.\r\n-Tech expo showcasing the latest innovations in AI, blockchain, and emerging technologies.\r\n-Interactive demos and hands-on experiences with groundbreaking products.\r\n-Networking opportunities with investors, startups, and industry professionals.\r\n-Hackathon or coding challenge to foster collaboration and creativity.', 499, NULL, 1, '2024-07-05 12:56:00', '2024-07-05 12:56:00'),
(98, 235, 'Luxurious Engagement Gala Decor Package', '', '', '-Create an opulent ambiance with exquisite decor, including elegant table settings adorned with enchanting ambient lighting.\r\n-Elevate your dining experience with lavish centerpieces and table accents, adding a touch of luxury and elegance to your celebration.\r\n-Set the stage for romance with tasteful floral arrangements and candlelight, enhancing the atmosphere of your engagement gala.\r\n-Capture the essence of your love story with a beautifully decorated backdrop or photo area, providing a stunning backdrop for cherished memories.\r\n-Extend gratitude to your guests with personalized party favors, adding a thoughtful touch to their experience and serving as a lasting memento of your special day', 933, NULL, 1, '2024-07-05 12:57:23', '2024-07-05 12:57:23'),
(99, 236, 'Luxurious Engagement Gala Decor Deal', '', '', '-Opulent Table Settings: Elevate your dining experience with lavish centerpieces, elegant table settings, and enchanting ambient lighting, adding a touch of luxury and elegance to your celebration.\r\n-Romantic Floral Arrangements: Set the stage for romance with tasteful floral arrangements and candlelight, enhancing the atmosphere of your engagement gala and adding a touch of natural beauty.\r\n-Captivating Photo Backdrops: Capture the essence of your love story with beautifully decorated backdrops or photo areas, providing stunning settings for cherished memories and photographs.\r\n-Thoughtful Party Favors: Extend gratitude to your guests with personalized party favors, adding a thoughtful touch to their experience and serving as a lasting memento of your special day.', 443, NULL, 1, '2024-07-06 06:03:42', '2024-07-06 06:03:42'),
(100, 236, 'Scholarly Achievement Gala Decor Package', '', '', '-Grand Ballroom Extravaganza: Transform your event space into a grand ballroom or prestigious venue adorned with academic regalia and school colors, setting the stage for an elegant celebration of scholarly achievements.\r\n-Culinary Excellence: Indulge in a formal dinner featuring gourmet cuisine and wine pairings, providing a delightful culinary experience for all attendees.\r\n-Recognition Ceremony: Honor academic achievements and outstanding contributions with a distinguished recognition ceremony, highlighting the accomplishments of scholars and contributors.\r\n-Inspirational Keynote Address: Be inspired by an uplifting keynote speech delivered by a distinguished guest or esteemed alumni, imparting wisdom and motivation to all attendees.\r\n-Professional Photography: Capture memorable moments throughout the gala with professional photography services, ensuring that every smile and achievement is preserved for years to come.\r\n-Festive After-Party: Continue the celebration with an after-party featuring live entertainment and dancing, allowing guests to unwind and revel in their accomplishments.', 345, NULL, 1, '2024-07-06 06:04:25', '2024-07-06 06:04:25'),
(101, 236, 'Chic Cocktail Affair Experience', '', '', '-Trendy Venue Vibes: Immerse yourself in a stylish ambiance with a trendy venue boasting modern decor and ambient lighting, setting the stage for an unforgettable affair.\r\n-Cocktail-style Reception: Enjoy a chic cocktail-style reception featuring passed hors d\'oeuvres and specialty drinks, tantalizing the taste buds of all attendees.\r\n-Live Music or Acoustic Performance: Set a relaxed atmosphere with live music or an acoustic performance, providing entertainment and enhancing the overall ambiance.\r\n-Interactive Photo Booth: Capture fun memories with an interactive photo booth equipped with props and customized photo strips, ensuring laughter and memorable moments.\r\n-Personalized Party Favors: Delight guests with personalized engagement party favors, serving as thoughtful mementos of the celebration.\r\n-Toast and Speeches: Raise a toast and celebrate the happy couple with heartfelt speeches, sharing love and well wishes for their future together.', 22.2, NULL, 1, '2024-07-06 06:04:55', '2024-07-06 06:04:55'),
(102, 237, 'Community Celebration Decor & Ceremony Package', '', '', '-Symbolic Venue Decor: Embrace a welcoming atmosphere with a venue adorned with religious symbolism and cultural decor, creating a space that honors traditions and fosters unity.\r\n-Religious Ceremony: Experience a meaningful religious ceremony officiated by a respected leader or clergy member, bringing the community together in prayer and reflection.\r\n-Culinary Unity: Share in the spirit of community with a potluck or catered dinner featuring traditional dishes, celebrating diversity and cultural heritage through food.\r\n-Cultural Performances: Enjoy cultural performances or religious music, showcasing the rich tapestry of traditions within the community and adding to the festive ambiance.\r\n-Reflection Space: Provide a designated area for prayer or meditation, allowing attendees to find moments of peace and connection amidst the celebration.\r\n-Charitable Endeavors: Engage in a charity drive or volunteer activity to support a meaningful cause, embodying the spirit of giving and making a positive impact on the community.', 399, NULL, 1, '2024-07-06 06:11:58', '2024-07-06 06:11:58'),
(103, 237, 'Tech Innovation Decor Showcase', '', '', '-Futuristic Venue Transformation: Transform your event space into a futuristic environment with sleek, modern decor and cutting-edge technological accents, setting the stage for innovation and creativity.\r\n-Technological Elegance: Incorporate advanced technological elements into the decor, such as LED displays, interactive digital installations, and holographic projections, creating a visually stunning and immersive experience.\r\n-Innovation Showcase: Highlight the latest advancements in AI, blockchain, and emerging technologies through innovative decor elements and thematic displays, allowing attendees to immerse themselves in the future of technology.\r\n-Interactive Displays: Engage attendees with interactive decor displays and hands-on experiences, allowing them to explore and interact with groundbreaking products and prototypes in a dynamic and engaging way.\r\n-Networking Zones: Designate stylish networking zones within the venue, featuring sleek furniture, high-tech lighting, and digital signage to facilitate connections and collaboration among attendees.\r\n-Creative Coding Corners: Set up creative coding corners or tech-inspired art installations, providing opportunities for guests to engage in collaborative coding challenges or showcase their technological creativity in a visually captivating way.', 499, NULL, 1, '2024-07-06 06:12:37', '2024-07-06 06:12:37'),
(104, 237, 'Sensational SoirÃ©e Decor & Entertainment Package', '', '', '-Chic Venue Transformation: Transform your venue into an upscale oasis with chic decor and stylish lounge areas, creating an atmosphere of sophistication and luxury for your soirÃ©e.\r\n-Musical Excellence: Enjoy live entertainment with a talented band or DJ spinning a mix of classic hits and current chart-toppers, setting the perfect soundtrack for an unforgettable evening.\r\n-Craft Cocktail Bar: Delight your guests with a craft cocktail bar manned by skilled mixologists, crafting custom drinks tailored to their tastes and preferences.\r\n-Culinary Delights: Indulge in gourmet food stations showcasing international cuisines and culinary delights, tantalizing the taste buds of all attendees with an array of delicious options.\r\n-Interactive Entertainment: Keep the excitement going with interactive entertainment options like a casino table or karaoke setup, providing guests with fun and engaging activities throughout the soirÃ©e.\r\n-Stylish Photo Opportunities: Capture memorable moments at a stylish photo booth featuring elegant props and digital sharing options, allowing guests to document and share the highlights of the evening.', 999, NULL, 1, '2024-07-06 06:13:14', '2024-07-06 06:13:14'),
(105, 238, 'Achour\'s Stars Extravaganza Party Van Package', '', '', '-Party Van Transformation: Watch as our party van undergoes a magical transformation, turning into a mobile extravaganza filled with vibrant decorations, dazzling lights, and all the theatrical flair you can imagine.\r\n\r\n-Themed Entertainment Spectacular: Step inside the party van and be mesmerized by our themed entertainment, including enchanting magic shows, whimsical puppet performances, and entertaining clown acts, ensuring an immersive experience for all young attendees.\r\n\r\n-On-the-Go Theatrical Activities: Engage in theatrical activities on the move, including face painting and balloon twisting, where children can transform into characters from their favorite stories and adventures, adding to the excitement of the journey.\r\n\r\n-Kid-Friendly Buffet: Keep the party going with a kid-friendly buffet onboard, offering a delightful array of snacks and drinks to keep everyone fueled for the festivities ahead.\r\n\r\n-Party Favor Bonanza: Send all the little guests home with party favors and treats, ensuring they leave with smiles on their faces and memories of the incredible bash on wheels.\r\n\r\n-Optional Themed Treats: Add an extra layer of fun with optional themed treats, such as custom-designed cupcakes or snacks, ensuring every moment of the party van bash is filled with delight.', 999, NULL, 1, '2024-07-06 06:52:59', '2024-07-06 06:52:59'),
(106, 238, 'School Showcase Party Van Extravaganza Package', '', '', '-Dramatic Venue Transformation: Transform your school gymnasium or outdoor field into a grand showcase setting with vibrant banners, stage props, and dramatic lighting, creating an atmosphere of excitement and anticipation for all attendees.\r\n\r\n-Student Performances: Experience the magic of live performances with a showcase featuring student actors, singers, and dancers displaying their talents in a captivating show, entertaining and inspiring the audience.\r\n\r\n-Interactive Activities Galore: Enjoy carnival-style games and activities with a twist, including interactive booths inspired by famous plays and musicals, ensuring endless entertainment for everyone and fostering creativity and engagement.\r\n\r\n-Culinary Delights: Savor a variety of delicious cuisines from our food truck rally, featuring themed treats and snacks to enhance the experience and satisfy every appetite.\r\n\r\n-Student Talent Showcase: Showcase student talent in a thrilling talent show or lip-sync battle, where performers can channel their favorite characters or scenes from iconic productions, celebrating the diversity and creativity of the school community.\r\n\r\n-Customized Event Merchandise: Purchase customized event T-shirts and merchandise adorned with creative designs, allowing students to commemorate the day and create lasting memories of the event.', 999, NULL, 1, '2024-07-06 06:53:47', '2024-07-06 06:53:47'),
(107, 238, 'Anchour\'s Frontier Experience Party Van Extravaganza Package', '', '', '-Dynamic Outdoor Venue: Feel the energy of our vibrant outdoor venue as our party van transports you to multiple stages hosting live entertainment and DJs, ensuring non-stop excitement and showcasing a diverse range of talent.\r\n\r\n-Festival Atmosphere: Immerse yourself in the lively ambiance of our festival-inspired grounds, adorned with captivating art installations and interactive displays that spark conversations and ignite your imagination, all within the dynamic setting of our party van.\r\n\r\n-Culinary Delights Hub: Indulge your taste buds at our culinary hub onboard the party van, offering a unique selection of mouthwatering treats and comfort foods to tantalize every palate as you party on the move.\r\n\r\n-VIP Oasis: Elevate your experience with our VIP ticket option, granting you exclusive access to luxurious lounges within the party van, priority entry to attractions, artist meet-and-greets, and VIP amenities. Enjoy the opportunity to mingle with performers and indulge in the festivities in style.\r\n\r\n-Keepsakes: Take home a piece of the experience with our onboard merchandise booths, offering a curated selection of apparel and memorabilia to commemorate your unforgettable Frontier Experience, ensuring the memories last long after the party ends.', 1000, NULL, 1, '2024-07-06 06:54:25', '2024-07-06 06:54:25'),
(108, 240, 'Feast & Celebration Party Van Extravaganza Package', '', '', '-Tailored Dining Experience: Indulge in a sumptuous multi-course feast served in our elegant dining area within the party van, adorned with ambient lighting to enhance the dining experience.\r\n\r\n-Champagne Toast: Raise a toast to celebrate your milestones with glasses of champagne, adding an extra touch of elegance to the festivities within the luxurious setting of our party van.\r\n\r\n-Live Music or DJ: Set the mood with live music or a DJ onboard the party van, providing a soundtrack for the night as you dance away and create unforgettable memories within the mobile celebration space.\r\n\r\n-Professional Photography: Capture precious moments with professional photography services onboard the party van, ensuring every smile and laugh is immortalized for you to cherish.\r\n\r\n-Personalized Party Favors: Send your guests home with personalized party favors, allowing them to remember the night and your celebration of love, all within the unique and intimate setting of our party van.', 599, NULL, 1, '2024-07-08 03:40:57', '2024-07-08 03:40:57'),
(109, 240, 'Networking Ride & Party Extravaganza Package', '', '', '-Sophisticated Venue on Wheels: Embark on a sophisticated ride aboard our luxurious party bus, meticulously designed to provide a professional ambiance conducive to networking interactions and business discussions while en route to your destination. Upon arrival, continue the networking experience in our exclusive party van.\r\n\r\n-Industry Expert Engagement: Engage with industry experts through keynote speeches or panel discussions on relevant topics, gaining valuable insights and fostering professional connections within the dynamic setting of our party ride and van.\r\n\r\n-Networking Activities: Foster connections and collaboration through networking games and icebreakers tailored to your event, facilitating meaningful interactions and enhancing relationship-building among attendees as you journey and party.\r\n\r\n-Premium Open Bar: Indulge in our premium open bar onboard both the party ride and van, offering top-shelf liquor and signature cocktails curated to elevate your networking experience and provide a touch of luxury throughout the ride and party.\r\n\r\n-Gourmet Cuisine: Delight your palate with gourmet hors d\'oeuvres and carving stations, meticulously crafted to impress even the most discerning tastes and enhance the overall networking experience for all guests, whether on the move or stationary.\r\n\r\n-Brand Presence Enhancement: Elevate your brand presence with branded promotional materials and gift bags for attendees, leaving a lasting impression and reinforcing your company\'s identity and message on both the party ride and van.', 799, NULL, 1, '2024-07-08 03:42:21', '2024-07-08 03:42:21'),
(110, 240, 'Masquerade Magic Party Van and Bus Extravaganza Package', '', '', '-Enchanting Ambiance: Step into our elegant party van and buses adorned with masks, feathers, and drapes, transporting you to a world of mystery and intrigue from the moment you arrive.\r\n\r\n-Captivating Entertainment: Dance the night away to sultry tunes spun by a live band or DJ onboard the party van and buses, adding to the allure of the evening and ensuring a memorable experience for all guests.\r\n\r\n-VIP Experience: Elevate your experience with our exclusive VIP lounge areas onboard the party van and buses, where bottle service and exclusive entertainment await to pamper you and your guests in style.\r\n\r\n-Exotic Libations: Indulge in specialty drinks from our exotic cocktail bars onboard the party van and buses, expertly crafted to tantalize your senses and complement the enchanting ambiance of the masquerade-themed party.\r\n\r\n-Glamorous Photo Opportunities: Strike a pose at our themed photo booths onboard the party van and buses, adorned with glamorous props to capture the magic of the night and create lasting memories with your friends.\r\n\r\n-Sensational Performances: Be mesmerized by sensual burlesque or cabaret performances onboard the party van and buses, adding an element of sophistication and excitement to the evening and ensuring an unforgettable entertainment experience.', 699, NULL, 1, '2024-07-08 03:43:03', '2024-07-08 03:43:03'),
(111, 241, 'Professional Development Party Van & Bus Conference Experienc', '', '', '-Mobile Conference Setup: Our fleet of party vans and buses transforms into a modern conference setup equipped with state-of-the-art audiovisual equipment, ensuring a dynamic environment for professional development activities while on the move.\r\n\r\n-Insightful Presentations: Engage with keynote speakers and participate in breakout sessions covering industry trends and insights, all while cruising in our comfortable and stylish party vans and buses.\r\n\r\n-Networking Lounges: Connect with peers and colleagues in our networking lounges onboard, featuring designated meeting areas conducive to productive discussions and relationship-building opportunities as you travel to your destination.\r\n\r\n-Gourmet Catering: Enjoy a buffet-style lunch featuring a variety of healthy options and dietary accommodations, served onboard our party vans and buses, ensuring that all attendees are fueled for an enriching conference experience throughout the journey.\r\n\r\n-Interactive Expo: Explore interactive expo booths showcasing the latest products and services in your industry, offering hands-on experiences and valuable insights while traveling in our party vans and buses.\r\n\r\n-Customized Event App: Stay organized and engaged with our customized event app, accessible onboard the party vans and buses, providing easy access to session schedules, speaker profiles, and interactive features to enhance attendee engagement throughout the conference journey.', 699, NULL, 1, '2024-07-08 03:52:45', '2024-07-08 03:52:45'),
(112, 241, 'Flexible Conference Party Van & Bus Experience', '', '', '-Mobile Conference Setup: Our fleet of party vans and buses provides a flexible conference setup with modern amenities and state-of-the-art audiovisual equipment, ensuring that your conference needs are met while on the move.\r\n\r\n-Engaging Presentations: Engage with keynote speakers and participate in insightful breakout sessions, all conducted within the comfort and convenience of our party vans and buses, keeping you updated on industry trends while traveling to your destination.\r\n\r\n-Networking Lounges: Network and collaborate in our dedicated lounges onboard, designed for productive meetings and discussions, fostering meaningful connections among attendees as you journey to your conference venue.\r\n\r\n-Delicious Catering: Enjoy a buffet-style lunch with healthy options served onboard our party vans and buses, accommodating various dietary needs to keep you energized and focused throughout the day-long conference journey.\r\n\r\n-Interactive Expo: Explore interactive expo booths displaying the latest products and services in your industry, offering valuable insights and connections while traveling in our party vans and buses.\r\n\r\n-Custom Event App: Stay organized and engaged with our custom event app, accessible onboard the party vans and buses, providing easy access to session schedules and facilitating attendee interaction throughout the conference journey.', 899, NULL, 1, '2024-07-08 03:53:35', '2024-07-08 03:53:35'),
(113, 241, 'Enchanted Romance Party Van Wedding Experience', '', '', '-Magical Venue: Step into our enchanting party van adorned with soft lighting, lush floral arrangements, and flowing drapery, creating a fairy tale setting for your romantic celebration on wheels.\r\n\r\n-Harmonious Melodies: Serenade your guests with the harmonious melodies of a live string quartet or pianist onboard the party van, adding a touch of magic to your ceremony and cocktail hour as you journey to your wedding destination.\r\n\r\n-Champagne Toast and CanapÃ© Reception: Raise a toast to love and happiness with a champagne toast and indulge in a delectable canapÃ© reception onboard the party van, delighting the senses and creating cherished memories with your loved ones.\r\n\r\n-Multi-Course Plated Dinner: Dine in style with a multi-course plated dinner onboard the party van, featuring customizable menu options tailored to your tastes and preferences, ensuring a culinary experience as enchanting as your love story.\r\n\r\n-Experienced Wedding Planner: Let our experienced wedding planner guide you through every step of the journey, from planning to execution, ensuring a seamless and stress-free celebration as you embark on the next chapter of your love story.\r\n\r\n-Personalized Wedding Favors and Guestbook: Leave a lasting impression with customized wedding favors and a guestbook onboard the party van, capturing precious memories of your enchanted day and providing keepsakes for your guests to cherish.', 499, NULL, 1, '2024-07-08 03:54:22', '2024-07-08 03:54:22');
