(131, 247, 'Professional Development Equipment & Venue Package', '', '', '-Modern Conference Venue: Host your professional development event in a modern conference venue equipped with state-of-the-art audiovisual equipment. Our rentals ensure that presentations are delivered seamlessly, capturing attendees\' attention.\r\n\r\n-Keynote Speakers and Breakout Sessions: Engage your audience with keynote speakers and breakout sessions covering industry trends and insights. Our rental audiovisual equipment ensures that every word is heard clearly, providing valuable information to all participants.\r\n\r\n-Networking Lounges: Facilitate connections with networking lounges featuring designated meeting areas. Our rental furniture creates comfortable spaces where attendees can network and exchange ideas in a relaxed setting.\r\n\r\n-Buffet-Style Lunch: Enjoy a buffet-style lunch featuring healthy options and dietary accommodations. Our catering equipment rentals ensure that every guest is satisfied with a delicious and nutritious meal.\r\n\r\n-Interactive Expo Booths: Explore interactive expo booths showcasing the latest products and services. Our rental booths and displays provide exhibitors with the perfect platform to engage with attendees and demonstrate their innovations.\r\n\r\n-Customized Event App: Stay organized and engaged with a customized event app for session schedules and attendee engagement. Our tech rental services ensure that attendees have easy access to event information and can participate in interactive features.', 123, NULL, 1, '2024-07-08 05:50:30', '2024-07-08 05:50:30'),
(132, 248, 'Wine Dealer Package', '', '', '-Exotic Venue Setup: Host your dream wedding at an exotic beach or picturesque destination venue. Our equipment and decor rentals create a dreamy backdrop, ensuring your special day is set in a stunning location. Includes setup of tents, seating, floral arrangements, and lighting.\r\n\r\n-Personalized Ceremony: Enjoy a personalized ceremony overlooking the ocean or scenic landscape. Our rental equipment includes everything needed for a beautiful and intimate ceremony setup, such as an altar, aisle runner, and decorative arches. Coordination with local officiants to personalize your vows.\r\n\r\n-Tropical-Themed Reception: Delight guests with a reception featuring a tropical-themed menu with fresh seafood and island delicacies. Our catering equipment rentals ensure that each dish is served elegantly, enhancing the dining experience. Includes tables, chairs, tableware, and serving stations.\r\n\r\n-Sunset Cocktail Hour: Create an unforgettable sunset cocktail hour with signature drinks and live music. Our rental bar setup and sound equipment provide the perfect ambiance for a relaxed and enjoyable evening. Licensed caterers available to serve alcohol and create custom cocktails.\r\n\r\n-Beach Bonfire or Lantern Release: Add a romantic touch with a beach bonfire or lantern release. Our rental equipment ensures these activities are set up safely and beautifully, creating lasting memories for you and your guests. Includes fire safety equipment and coordination with local authorities for permits.\r\n\r\n-Honeymoon Suite or Luxury Villa: Complete your wedding experience with accommodation in a honeymoon suite or luxury villa. Our rental services ensure that your stay is comfortable and', 45, NULL, 1, '2024-07-08 06:14:22', '2024-07-08 06:14:22'),
(133, 248, 'Masquerade Ball Extravaganza Equipment & Venue Package', '', '', '-Elegant Venue Setup: Host your masquerade ball in an elegant venue adorned with masks, feathers, and drapes. Our equipment and decor rentals create a luxurious and mysterious atmosphere perfect for the occasion.\r\n\r\n-Music Setup: Set the mood with a live band or DJ playing sultry tunes for dancing. Our rental sound system and lighting equipment ensure that the music fills the venue and keeps guests on the dance floor.\r\n\r\n-VIP Lounge Area: Offer an exclusive experience with a VIP lounge area featuring bottle service and exclusive entertainment. Our rental furniture and decor create a sophisticated and comfortable space for VIP guests.\r\n\r\n-Exotic Cocktail Bar: Impress guests with an exotic cocktail bar serving specialty drinks. Our rental bar setup and equipment ensure that each drink is crafted to perfection, adding to the allure of the evening.\r\n\r\n-Themed Photo Booth: Capture the night\'s memories with a themed photo booth featuring glamorous props. Our rental photo booth setup ensures guests can take stunning photos to remember the event.\r\n\r\n-Sensual Performance: Provide captivating entertainment with a sensual burlesque or cabaret performance. Our rental stage and audiovisual equipment ensure that the performance is showcased beautifully and safely', 123, NULL, 1, '2024-07-08 06:14:58', '2024-07-08 06:14:58'),
(134, 248, 'Innovation Expo Experience Equipment & Venue Package', '', '', '-Dynamic Expo Floor Layout: Design a dynamic expo floor with themed zones and interactive displays. Our equipment and decor rentals create an engaging and visually appealing environment for attendees.\r\n\r\n-Product Demonstrations and Workshops: Facilitate product demonstrations and hands-on workshops with our rental audiovisual and presentation equipment, ensuring clear and impactful sessions.\r\n\r\n-Startup Pitch Competition: Host a startup pitch competition or innovation awards ceremony. Our stage and sound equipment rentals ensure a professional setup that highlights the participants and their innovations.\r\n\r\n-Catered Reception: Delight attendees with a catered reception featuring artisanal food stations and craft beer tastings. Our catering equipment rentals provide everything needed for a seamless and enjoyable dining experience.\r\n\r\n-Networking Roundtables: Organize networking roundtables focused on specific topics or industries. Our rental furniture creates comfortable and conducive spaces for meaningful discussions and connections.\r\n\r\n-Swag Bags: Offer swag bags with promotional items and informational materials. Our rental display stands ensure that swag bags are presented attractively, adding value to the attendee experience.', 125, NULL, 1, '2024-07-08 06:15:50', '2024-07-08 06:15:50'),
(135, 249, 'Little Explorers Package', '', '', '-Colorful Venue Decoration: Transform your venue into a vibrant wonderland with colorful balloons and banners, creating an exciting atmosphere for young adventurers.\r\n\r\n-Themed Entertainment: Delight little explorers with captivating performances such as magic shows, puppet shows, or clown performances, sparking their imagination and keeping them entertained throughout the event.\r\n\r\n-Interactive Activities: Let their creativity soar with face painting and balloon twisting activities, where they can transform into their favorite characters and animals, adding a touch of whimsy to the celebration.\r\n\r\n-Kid-Friendly Buffet: Treat young taste buds with a delightful buffet offering a variety of snacks and drinks, ensuring there\'s something for every little explorer to enjoy.\r\n\r\n-Juice Bar: Quench their thirst with a selection of refreshing fruit juices and mocktails, served from a vibrant juice bar that adds an extra splash of color to the festivities.\r\n\r\n-Goodie Bags: Send each little guest home with a special goodie bag filled with treats and treasures, a token of appreciation for joining in the adventure-filled celebration.\r\n\r\n-Themed Cake or Cupcakes: Add a sweet finale to the festivities with an option for a themed cake or cupcakes, delighting little ones with a delicious and visually stunning dessert.', 399, NULL, 1, '2024-07-08 06:23:07', '2024-07-08 06:23:07'),
(136, 249, 'Glow Party Package', '', '', '-Neon-Themed Venue Decor: Illuminate your venue with neon-themed decor, featuring UV lights and glow sticks that create a mesmerizing ambiance, perfect for a vibrant and energetic celebration.\r\n\r\n-Professional DJ Booth: Keep the party alive with a professional DJ spinning the latest hits, creating an electrifying atmosphere that gets everyone on their feet and dancing all night long.\r\n\r\n-Dynamic Dance Floor: Set the stage for an epic dance party with a dynamic dance floor equipped with fog machines and laser lights, turning your venue into a pulsating nightclub experience.\r\n\r\n-Mocktail Bar: Quench your guests\' thirst with a mocktail bar serving vibrant non-alcoholic drinks that glow under the blacklights, adding a colorful and refreshing twist to the festivities.\r\n\r\n-Soda Bar: Offer a variety of sodas and fizzy drinks at the soda bar, providing additional beverage options for guests to enjoy alongside their mocktails.\r\n\r\n-Funky Photo Booth: Capture memorable moments with a funky photo booth complete with neon-themed props, allowing guests to snap and share their glowing memories with friends and family.\r\n\r\n-Customized Snapchat Filter: Make your event even more memorable with a customized Snapchat filter, allowing guests to share their glowing moments on social media and immortalize the fun.', 499, NULL, 1, '2024-07-08 06:24:13', '2024-07-08 06:24:13'),
(137, 249, 'Casino Night Bash', '', '', '-Themed Venue: Step into a world of high stakes and glamour with a themed venue decorated to resemble a high-end casino, complete with luxurious decor and ambiance that transport guests to the heart of Las Vegas.\r\n\r\n-Professional Dealers: Experience the thrill of the casino floor with professional dealers at blackjack, poker, and roulette tables, ensuring an authentic and exhilarating gaming experience for all attendees.\r\n\r\n-Customized \"Fun Money\": Each guest receives customized \"fun money\" to play with, adding to the excitement and allowing everyone to enjoy the thrill of gambling without the risk.\r\n\r\n-Cocktail Bar: Sip on classic cocktails and signature drinks crafted by skilled bartenders at the cocktail bar, adding sophistication and style to the evening\'s festivities.\r\n\r\n-Buffet: Indulge in a sumptuous buffet featuring upscale finger foods and decadent desserts, offering a culinary delight for guests to enjoy between rounds of gaming.\r\n\r\n-Prizes: Compete for top honors and bragging rights with prizes awarded to the top players at the end of the night, adding an extra layer of excitement and competition to the event.\r\n\r\n-Coffee Deals: For guests looking to take a break from the gaming action, enjoy a selection of specialty coffees and espresso drinks at the coffee bar, providing a caffeinated boost to keep the energy high throughout the night.', 999, NULL, 1, '2024-07-08 06:31:43', '2024-07-08 06:31:43'),
(138, 250, 'Sumptuous Feast & Celebration', '', '', '-Tailored Multi-Course Feast: Indulge in a culinary journey with a tailored, multi-course feast served in our elegant dining area, complete with ambient lighting that sets the perfect mood for a sumptuous celebration.\r\n\r\n-Champagne Toast: Raise a toast to your milestones with premium champagne, adding a touch of elegance and sophistication to your celebration.\r\n\r\n-Live Music or DJ: Set the mood and get the party started with live music or a DJ spinning your favorite tunes, ensuring a lively atmosphere that keeps guests on the dance floor all night long.\r\n\r\n-Professional Photography: Capture every moment of your special celebration with professional photography services, ensuring that precious memories are preserved for years to come.\r\n\r\n-Personalized Party Favors: Send guests home with personalized party favors to commemorate the night, adding a thoughtful touch to their memories of your unforgettable celebration.\r\n\r\n-Drinks Deals: Enhance your celebration with special drinks deals, offering a selection of cocktails, wines, and spirits at discounted prices to keep the festivities flowing and the spirits high.', 599, NULL, 1, '2024-07-08 06:54:55', '2024-07-08 06:54:55'),
(139, 250, 'Networking Excellence Experience', '', '', '-Sophisticated Venue: Immerse yourself in our sophisticated venue, meticulously designed to create a professional ambiance conducive to meaningful networking interactions.\r\n\r\n-Expert Engagement: Engage with industry experts through keynote speeches or panel discussions on relevant topics, gaining valuable insights and fostering professional connections.\r\n\r\n-Networking Games and Icebreakers: Foster connections and collaboration with tailored networking games and icebreakers, breaking down barriers and facilitating meaningful interactions among attendees.\r\n\r\n-Premium Open Bar: Indulge in our premium open bar, offering top-shelf liquor and signature cocktails curated by skilled mixologists to elevate your networking experience and encourage lively conversations.\r\n\r\n-Gourmet Hors d\'Oeuvres and Carving Stations: Delight your palate with gourmet hors d\'oeuvres and carving stations, meticulously crafted to impress even the most discerning of tastes and provide a memorable culinary experience.\r\n\r\n-Branded Promotional Materials and Gift Bags: Enhance your brand presence with branded promotional materials and gift bags for attendees, leaving a lasting impression and reinforcing your company\'s identity long after the event concludes.\r\n\r\n-Drinks Deals: Complement your networking experience with exclusive drinks deals, offering a selection of beverages at discounted prices to enhance the networking ambiance and elevate the overall experience for attendees.', 799, NULL, 1, '2024-07-08 06:56:34', '2024-07-08 06:56:34'),
(140, 250, 'Masquerade Magic Highlights', '', '', '-Enchanting Ambiance: Step into our elegant venue adorned with masks, feathers, and drapes, where every corner exudes an air of mystery and intrigue, setting the stage for an enchanting evening.\r\n\r\n-Captivating Entertainment: Lose yourself on the dance floor as you sway to the sultry tunes spun by a live band or DJ, adding to the allure and excitement of the night\'s festivities.\r\n\r\n-VIP Experience: Elevate your evening with our exclusive VIP lounge area, where bottle service and exclusive entertainment await, providing a luxurious retreat for those seeking an extra touch of sophistication.\r\n\r\n-Exotic Libations: Delight your senses with specialty drinks from our exotic cocktail bar, expertly crafted to tantalize your taste buds and complement the ambiance of the masquerade atmosphere.\r\n\r\n-Glamorous Photo Opportunities: Strike a pose and capture the magic of the night at our themed photo booth, adorned with glamorous props that provide the perfect backdrop for unforgettable memories.\r\n\r\n-Sensational Performances: Be mesmerized by sensual burlesque or cabaret performances, adding an element of glamour, sophistication, and excitement to the evening\'s entertainment lineup.\r\n\r\n-Drinks Deals: Enhance your experience with exclusive drinks deals, offering a selection of cocktails, wines, and spirits at discounted prices throughout the evening, ensuring that the celebration is as memorable as it is enjoyable', 699, NULL, 1, '2024-07-08 06:57:46', '2024-07-08 06:57:46'),
(141, 251, 'Professional Development Package', '', '', '-Modern Conference Venue: Immerse yourself in a modern conference venue equipped with state-of-the-art audiovisual equipment, providing an optimal environment for learning and collaboration.\r\n\r\n-Keynote Speakers and Breakout Sessions: Gain valuable insights from industry leaders through keynote speeches and breakout sessions covering the latest trends and insights in your field, ensuring a comprehensive professional development experience.\r\n\r\n-Networking Lounges: Connect and collaborate with peers in designated networking lounges, offering comfortable meeting areas conducive to meaningful discussions and relationship-building.\r\n\r\n-Buffet-Style Lunch: Enjoy a nutritious buffet-style lunch featuring a variety of healthy options and dietary accommodations, ensuring that all attendees can refuel and recharge during the event.\r\n\r\n-Interactive Expo Booths: Explore interactive expo booths showcasing the latest products and services in your industry, providing opportunities to discover innovative solutions and network with exhibitors.\r\n\r\n-Customized Event App: Stay organized and engaged with a customized event app, providing access to session schedules, speaker information, and interactive features that enhance attendee engagement and participation.\r\n\r\n-Drinks Deals: Enhance your networking experience with exclusive drinks deals, offering a selection of beverages at discounted prices throughout the event, facilitating relaxed and productive interactions among attendees.', 699, NULL, 1, '2024-07-08 07:07:29', '2024-07-08 07:07:29'),
(142, 251, 'Flexible Conference Package', '', '', '-Modern Venue and Equipment: Experience the convenience of our venue with modern amenities and state-of-the-art audiovisual equipment, ensuring your conference needs are met with efficiency and professionalism.\r\n\r\n-Engaging Sessions: Engage with keynote speakers and participate in insightful breakout sessions, keeping you updated on the latest industry trends and providing valuable insights to enhance your knowledge and skills.\r\n\r\n-Networking Lounges: Network and collaborate in our dedicated lounges, thoughtfully designed for productive meetings and discussions, fostering connections and partnerships that drive success.\r\n\r\n-Healthy Buffet Lunch: Enjoy a buffet-style lunch featuring healthy options and accommodating various dietary needs, ensuring that you stay energized and focused throughout the day.\r\n\r\n-Interactive Expo Booths: Explore interactive expo booths showcasing the latest products and services in your industry, offering valuable insights and opportunities to connect with exhibitors and peers.\r\n\r\n-Custom Event App: Stay organized and engaged with our custom event app, providing easy access to session schedules, speaker information, and interactive features that facilitate attendee interaction and participation.\r\n\r\n-Drinks Deals: Enhance your conference experience with exclusive drinks deals, offering a selection of beverages at discounted prices throughout the event, providing refreshment and relaxation for attendees.', 899, NULL, 1, '2024-07-08 07:08:11', '2024-07-08 07:08:11'),
