(149, 253, 'Casino Night Bash', '', '', '- Themed venue decorated to resemble a high-end casino.\r\n- Professional dealers at blackjack, poker, and roulette tables.\r\n- Customized \"fun money\" for guests to play with.\r\n- Cocktail bar with skilled bartenders crafting classic drinks.\r\n- Buffet with upscale finger foods and desserts.\r\n- Prizes for top players at the end of the night.', 999, NULL, 1, '2024-07-08 09:02:19', '2024-07-08 09:02:19'),
(150, 254, 'Sumptuous Feast & Celebration', '', '', '- Enjoy a tailored, multi-course feast in our elegant dining area, complete with ambient lighting.\r\n- Raise a toast with champagne as you celebrate your milestones.\r\n- Let live music or a DJ set the mood while you dance the night away.\r\n- Capture precious moments with professional photography services.\r\n- Send guests home with personalized party favors to remember the night.', 599, NULL, 1, '2024-07-08 09:22:20', '2024-07-08 09:22:20'),
(151, 254, 'Networking Excellence Experience', '', '', '- Immerse yourself in our sophisticated venue, designed for professional ambiance and networking interactions.\r\n- Engage with industry experts through keynote speeches or panel discussions on relevant topics.\r\n- Foster connections and collaboration through networking games and icebreakers tailored to your event.\r\n- Indulge in our premium open bar, offering top-shelf liquor and signature cocktails to elevate your experience.\r\n- Delight your palate with gourmet hors d\'oeuvres and carving stations, meticulously crafted to impress.\r\n- Enhance your brand presence with branded promotional materials and gift bags for attendees, leaving a lasting impression.', 799, NULL, 1, '2024-07-08 09:23:28', '2024-07-08 09:23:28'),
(152, 254, 'Masquerade Magic Highlights', '', '', '- Enchanting Ambiance: Our elegant venue is adorned with masks, feathers, and drapes, transporting you to a world of mystery and intrigue.\r\n- Captivating Entertainment: Dance the night away to sultry tunes spun by a live band or DJ, adding to the allure of the evening.\r\n- VIP Experience: Retreat to our exclusive VIP lounge area, where bottle service and exclusive entertainment await to elevate your experience.\r\n- Exotic Libations: Indulge in specialty drinks from our exotic cocktail bar, expertly crafted to tantalize your senses and complement the ambiance.\r\n- Glamorous Photo Opportunities: Strike a pose at our themed photo booth, adorned with glamorous props to capture the magic of the night.\r\n- Sensational Performances: Be mesmerized by sensual burlesque or cabaret performances, adding an element of sophistication and excitement to the evening.', 699, NULL, 1, '2024-07-08 09:24:20', '2024-07-08 09:24:20'),
(153, 255, 'Professional Development Package', '', '', '- Modern conference venue with state-of-the-art audiovisual equipment.\r\n- Keynote speakers and breakout sessions covering industry trends and insights.\r\n- Networking lounges with designated meeting areas.\r\n- Buffet-style lunch featuring healthy options and dietary accommodations.\r\n- Interactive expo booths showcasing the latest products and services.\r\n- Customized event app for session schedules and attendee engagement.', 699, NULL, 1, '2024-07-08 09:58:57', '2024-07-08 09:58:57'),
(154, 255, 'Flexible Conference Package', '', '', '- Our venue boasts modern amenities and state-of-the-art audiovisual equipment, ensuring your conference needs are met.\r\n- Engage with keynote speakers and participate in insightful breakout sessions, keeping you updated on industry trends.\r\n- Network and collaborate in our dedicated lounges, designed for productive meetings and discussions.\r\n- Enjoy a buffet-style lunch with healthy options, accommodating various dietary needs to keep you energized throughout the day.\r\n- Explore interactive expo booths displaying the latest products and services, offering valuable insights and connections.\r\n- Stay organized and engaged with our custom event app, providing easy access to session schedules and facilitating attendee interaction.', 899, NULL, 1, '2024-07-08 09:59:37', '2024-07-08 09:59:37'),
(155, 255, 'Enchanted Romance Package', '', '', '- Step into an elegant venue adorned with soft lighting, lush floral arrangements, and flowing drapery, setting the stage for your fairy tale romance.\r\n- Serenade your guests with the harmonious melodies of a live string quartet or pianist during the ceremony and cocktail hour, creating a magical ambiance.\r\n- Raise a toast to love and happiness with a champagne toast and indulge in a delectable canapÃ© reception, delighting the senses.\r\n- Dine in style with a multi-course plated dinner, featuring customizable menu options tailored to your tastes and preferences.\r\n- Let our experienced wedding planner guide you through every step of the journey, ensuring a seamless and stress-free celebration.\r\n- Leave a lasting impression with customized wedding favors and a guestbook, capturing precious memories of your enchanted day.', 499, NULL, 1, '2024-07-08 10:00:16', '2024-07-08 10:00:16'),
(156, 256, 'Farm City Warehouse Music Festival Package', '', '', '- Step into our dynamic outdoor venue, featuring multiple stages hosting live bands and DJs, ensuring non-stop entertainment and a diverse lineup of musical talent.\r\n- Immerse yourself in the vibrant atmosphere of our festival grounds, adorned with captivating art installations and interactive displays that ignite your imagination and spark conversation.\r\n- Explore our food truck village, where a tantalizing array of culinary delights awaits, from savory street food to indulgent desserts, satisfying every craving and delighting every palate.\r\n- Quench your thirst at our craft beer garden, where you can sample a selection of locally brewed beers and specialty brews, each sip a celebration of craftsmanship and flavor.\r\n- Elevate your festival experience with our VIP ticket option, granting you exclusive access to lounges and artist meet-and-greets, allowing you to mingle with performers and enjoy VIP amenities in style.\r\n- Don\'t miss the opportunity to take home a piece of the festival magic with our festival merchandise booths, offering a curated selection of apparel and memorabilia to commemorate your experience.', 399, NULL, 1, '2024-07-08 10:09:22', '2024-07-08 10:09:22'),
(157, 256, 'Community Celebration Package', '', '', '- Our welcoming venue is adorned with religious symbolism and cultural decor, creating a warm and inclusive atmosphere for all.\r\n- Experience a meaningful religious ceremony officiated by a respected leader or clergy member, fostering spiritual unity and reflection.\r\n- Share in the joy of community with a potluck or catered dinner featuring traditional dishes, a feast for the senses that celebrates cultural heritage.\r\n- Be captivated by cultural performances or religious music, showcasing the rich tapestry of talent within our community and inspiring hearts and minds.\r\n- Find solace and connection in our dedicated prayer or meditation space, offering a tranquil retreat for personal reflection and spiritual renewal.\r\n- Give back to the community with a charity drive or volunteer activity, joining together to support a meaningful cause and make a positive impact in the world.', 499, NULL, 1, '2024-07-08 10:10:03', '2024-07-08 10:10:03'),
(158, 256, 'School Spirit Extravaganza Package', '', '', '- Transform your school gymnasium or outdoor field with vibrant banners, mascots, and school colors, creating an atmosphere of unity and enthusiasm.\r\n- Dance the day away with a DJ or live band playing popular music, setting the perfect backdrop for a high-energy celebration.\r\n- Enjoy carnival-style games and activities, including dunk tanks, ring toss, and more, ensuring endless fun for everyone.\r\n- Savor a variety of delicious cuisines from our food truck rally, featuring student-favorite foods to satisfy every craving.\r\n- Showcase student talent with a thrilling talent show or lip-sync battle, highlighting the unique skills and creativity of your school community.\r\n- Purchase customized event T-shirts and merchandise to commemorate the day and show off your school spirit with pride.', 999, NULL, 1, '2024-07-08 10:11:24', '2024-07-08 10:11:24'),
(159, 257, 'Little Explorers Package', '', '', '- Venue decoration with colorful balloons and banners.\r\n- Themed entertainment such as magic shows, puppet shows, or clown performances.\r\n- Face painting and balloon twisting activities.\r\n- Kid-friendly buffet with a variety of snacks and drinks.\r\n- Goodie bags for all the little guests.\r\n- Option for a themed cake or cupcakes.', 399, NULL, 1, '2024-07-08 10:30:51', '2024-07-08 10:30:51'),
(160, 257, 'Glow Party Package', '', '', '- Neon-themed venue decor with UV lights and glow sticks.\r\n- DJ booth with a professional DJ playing the latest hits.\r\n- Dance floor with fog machines and laser lights.\r\n- Mocktail bar serving vibrant non-alcoholic drinks.\r\n- Photo booth with funky props.\r\n- Customized Snapchat filter for the event.', 499, NULL, 1, '2024-07-08 10:31:52', '2024-07-08 10:31:52'),
(161, 257, 'Casino Night Bash', '', '', '- Themed venue decorated to resemble a high-end casino.\r\n- Professional dealers at blackjack, poker, and roulette tables.\r\n- Customized \"fun money\" for guests to play with.\r\n- Cocktail bar with skilled bartenders crafting classic drinks.\r\n- Buffet with upscale finger foods and desserts.\r\n- Prizes for top players at the end of the night.', 999, NULL, 1, '2024-07-08 10:37:05', '2024-07-08 10:37:05'),
