(10, 213, 'Mark1 Western Soundtrack', 1, 24, '-Cowboy Beats: Mark1\'s Western Soundtrack sets the stage on fire with tracks inspired by the untamed wild west.\r\n-Ride in Rhythm: Let the beats guide you through the trails of the stage, keeping you in sync with every note and every step.\r\n-Frontier Melodies: Each track is a journey through the rugged landscapes of cowboy culture, blending tradition with modern soundscapes.', 25, '2024-07-05 05:07:20', '2024-07-05 05:07:20'),
(11, 213, 'Mark1 Outlaw Hoodie', 1, 50, 'A rugged blend of frontier style and modern comfort for DJs, musicians, and entertainers. Crafted from a premium cotton-polyester blend, it\'s tough yet soft, featuring rustic graphics and earthy tones inspired by the old West. With a relaxed fit, ribbed cuffs, and an adjustable hood, it\'s perfect for stage performances or kicking back by the campfire. Get yours today and embrace the spirit of the Wild West!', 564, '2024-07-05 05:11:35', '2024-07-05 05:11:35'),
(12, 213, 'Mark1 Westerner Merchandise Collection', 1, 124, '-Gear up with the frontier\'s finest! Immerse yourself in the rugged melodies of cowboy culture with our exclusive Western-inspired tracks. Enjoy unlimited access to our collection and be the first to ride the frontier wave with early access to new releases. Join the posse today and outfit yourself with the best beats!', 250, '2024-07-05 05:13:21', '2024-07-05 05:13:21'),
(13, 214, 'Custom Floral Arrangements', 1, 24, '-Add a touch of enchantment to your special occasions with our bespoke floral arrangements. Tailored to your unique style and event, our designs bring beauty and elegance to every celebration. From stunning bouquets to captivating centerpieces, let Enchanted Blooms make your moments unforgettable.', 1025, '2024-07-05 05:45:21', '2024-07-05 05:45:21'),
(14, 214, ': Engagement Event Photography & Videography', 1, 24, '-Engaging photo and video booths capturing heartfelt moments\r\n-Personalized backdrops, props, and filters for creative expression\r\n-Skilled photographers and videographers documenting every cherished instant\r\n-Instant prints and digital downloads to treasure the memories\r\n-Eternalize the joy of your engagement with LoveLens.', 25, '2024-07-05 05:46:16', '2024-07-05 05:46:16'),
(15, 215, 'chour\'s Melody Magic Bluetooth Speaker', 1, 154, '-High-quality Sound: Crystal-clear audio and rich bass for immersive listening.\r\n-Bluetooth Connectivity: Wireless streaming from any compatible device.\r\n-Portable Design: Sleek and compact for on-the-go enjoyment..\r\n-Long-lasting Battery: Enjoy extended playtime without recharging.\r\n-Built-in Mic: Convenient hands-free calls and voice commands.\r\n-Stylish Options: Available in a range of chic colors.', 25.55, '2024-07-05 05:56:18', '2024-07-05 05:56:18'),
(16, 215, 'Achour\'s IllumiGlow LED Light Strips', 1, 500, '-Customizable Lighting: Set the mood with adjustable brightness, colors, and effects.\r\n-Easy Installation: Adhesive backing for hassle-free setup on any surface.\r\n-Versatile Use: Perfect for home decor, parties, events, and gaming setups.\r\n-Remote Control: Effortlessly adjust settings with the included remote.\r\n-Energy-efficient: Long-lasting LED technology for sustainable illumination.\r\n-Various Lengths: Available in different sizes to suit any space.', 5.55, '2024-07-05 05:57:30', '2024-07-05 05:57:30'),
(17, 215, 'Achour\'s Urban Chic Denim Jacket', 1, 500, '-Premium denim fabric for durability and comfort\r\n-Distressed detailing for a trendy and edgy look\r\n-Slim fit silhouette for a modern and flattering fit\r\n-Versatile styling options for casual or dressed-up outfits\r\n-Available in a range of sizes to suit different body types\r\n-Various Lengths: Available in different sizes to suit any space.', 75, '2024-07-05 05:59:11', '2024-07-05 05:59:11'),
(18, 216, 'UniQ Notebooks and Pens', 1, 154, '-Design custom notebooks and pens featuring the conference logo and branding. These practical items are perfect for attendees to take notes, jot down ideas, and stay organized during sessions and workshops.', 25.55, '2024-07-05 06:08:55', '2024-07-05 06:08:55'),
(19, 217, 'Musical Vibes', 1, 15, '- Each pack contains a variety of stickers with musical motifs, including DJ turntables, musical notes, headphones, party confetti, and more.\r\n- Made from high-quality vinyl material, these stickers are durable, waterproof, and fade-resistant, ensuring long-lasting enjoyment.\r\n- Easy to apply and remove, our stickers leave no residue behind, allowing you to customize your belongings without any hassle.\r\n- Ideal for personal use, gifting, or as party favors for event attendees, these stickers are a versatile and stylish addition to any collection.\r\n\r\nTransform your world with the vibrant energy of music and celebration with our \"Musical Vibes\" vinyl sticker pack!', 6.45, '2024-07-05 06:15:37', '2024-07-05 06:15:37'),
(20, 217, 'Majestic Melodies Extravaganza\" Graphic T-Shirt', 1, 15, '- Made from premium-quality cotton fabric for maximum comfort and durability.\r\n- Vibrant and long-lasting print that won\'t fade or crack over time, ensuring lasting enjoyment.\r\n- Available in a variety of sizes and colors to suit your individual style and preferences.\r\n- Perfect for everyday wear, casual outings, or as a souvenir to commemorate your experience at the Majestic Melodies Extravaganza event.', 24.99, '2024-07-05 06:16:51', '2024-07-05 06:16:51'),
